int misc::clear_bit2(int address, int pos)
{
	return address &= ~(1 << pos);
}

void misc::clear_bit(int* address, int pos)
{
	*address &= ~(1 << pos);
}

void misc::clear_bits(int* address, int bits)
{
	*address &= ~(bits);
}

bool misc::has_bit_set(int* address, int pos)
{
	return *address & 1 << pos;
}

bool misc::has_bits_set(int* address, int bits)
{
	return (*address & bits) == bits;
}

int misc::set_bit(int address, int pos)
{
	return address |= 1 << pos;
}

void misc::set_bits(int* address, int bits)
{
	*address |= bits;
}

