	if (Features::gg5 > 0 && Features::rr5 == 0) {
		Features::gg5--;
		Features::bb5++;
	}
	if (Features::bb5 > 0 && Features::gg5 == 0) {
		Features::rr5++;
		Features::bb5--;
	}
