bool Features::DisplayFPS = false;
void Features::featureDisplayFPS(bool toggle)
{
	/*string  DisplayFps001;
	DisplayFps001 = getenv("appdata");
	ofstream DisplayFps21(DisplayFps001 + "\\ThunderMenu\\DisplayFps.Thunder");*/
	if (DisplayFPS) {
		/*DisplayFps21 << "true";*/
		if ((timeGetTime() - Features::FPStimes) > 1000) {
			float LastFrameTime = GAMEPLAY::GET_FRAME_TIME();
			int getFPS = (1.0 / LastFrameTime);
			Features::FPS = getFPS;
			char FPStext[60];
			snprintf(FPStext, sizeof(FPStext), "FPS: ~r~ %d", Features::FPS);
			setupdraw();
			UI::SET_TEXT_FONT(6);
			UI::SET_TEXT_SCALE(0.5f, 0.5f);
			UI::SET_TEXT_COLOUR(255, 255, 255, 255);
			UI::SET_TEXT_CENTRE(0);
			drawstring(FPStext, Features::xzerovingt, Features::yzerodix);
			Features::FPStimes = timeGetTime();
		}
		char FPStext[60];
		snprintf(FPStext, sizeof(FPStext), "FPS: ~r~ %d", Features::FPS);
		setupdraw();
		UI::SET_TEXT_FONT(6);
		UI::SET_TEXT_SCALE(0.5f, 0.5f);
		UI::SET_TEXT_COLOUR(255, 255, 255, 255);
		UI::SET_TEXT_CENTRE(0);
		drawstring(FPStext, Features::xzerovingt, Features::yzerodix);
	}
	/*DisplayFps21 << " ";*/
}
