bool Features::dirtyloop = false;
void Features::dirty(bool toggle)
{
	if (PED::IS_PED_IN_ANY_VEHICLE(PLAYER::PLAYER_PED_ID(), false))
	{
		Vehicle vehicle = PED::GET_VEHICLE_PED_IS_USING(PLAYER::PLAYER_PED_ID());
		uint Vehicle = PED::GET_VEHICLE_PED_IS_USING(Features::playerme);
		VEHICLE::SET_VEHICLE_DIRT_LEVEL(vehicle, Dirt);
		VEHICLE::SET_VEHICLE_ENVEFF_SCALE(vehicle, Dirt);
		VEHICLE::SET_VEHICLE_DEFORMATION_FIXED(vehicle);
		VEHICLE::SET_VEHICLE_TYRES_CAN_BURST(vehicle, Dirt);
		VEHICLE::SET_VEHICLE_WHEELS_CAN_BREAK(vehicle, Dirt);
		VEHICLE::SET_VEHICLE_ENGINE_CAN_DEGRADE(vehicle, Dirt);
		VEHICLE::SET_VEHICLE_CAN_BREAK(vehicle, Dirt);
		VEHICLE::SET_VEHICLE_CAN_BE_VISIBLY_DAMAGED(vehicle, Dirt);
		VEHICLE::SET_VEHICLE_DAMAGE(vehicle, Dirt, Dirt, Dirt, Dirt, 200, false);
		if (VEHICLE::_IS_VEHICLE_DAMAGED(vehicle))
		{
			for (int i = 0; i < 10; i++)
			{
				try {
					VEHICLE::SET_VEHICLE_DIRT_LEVEL(vehicle, Dirt);
					VEHICLE::SET_VEHICLE_ENVEFF_SCALE(vehicle, Dirt);
					VEHICLE::SET_VEHICLE_DEFORMATION_FIXED(vehicle);
					VEHICLE::SET_VEHICLE_TYRES_CAN_BURST(vehicle, Dirt);
					VEHICLE::SET_VEHICLE_WHEELS_CAN_BREAK(vehicle, Dirt);
					VEHICLE::SET_VEHICLE_ENGINE_CAN_DEGRADE(vehicle, Dirt);
					VEHICLE::SET_VEHICLE_CAN_BREAK(vehicle, Dirt);
					VEHICLE::SET_VEHICLE_CAN_BE_VISIBLY_DAMAGED(vehicle, Dirt);
					VEHICLE::SET_VEHICLE_DAMAGE(vehicle, Dirt, Dirt, Dirt, Dirt, 200, false);
				}
				catch (...) {
					return;
				}
			}
		}
	}
}
