Object Create_Obj(char* ObjectName, Vector3 Coordinates)
{
	Object returnObja;
	/*Hash ObjectHash = HASH::GET_HASH_KEY(ObjectName);*/
	Hash ObjectHash = HASH::GET_HASH_KEY(ObjectName);
	if (STREAMING::IS_MODEL_IN_CDIMAGE(ObjectHash))
	{
		if (STREAMING::IS_MODEL_VALID(ObjectHash))
		{
			Hooking::request_model(ObjectHash);
			if (STREAMING::HAS_MODEL_LOADED(ObjectHash))
			{
				/*returnObja = OBJECT::CREATE_OBJECT(ObjectHash, Coordinates.x, Coordinates.y, Coordinates.z, 1, 1, 0);*/
				returnObja = OBJECT::CREATE_OBJECT_NO_OFFSET(ObjectHash, Coordinates.x, Coordinates.y, Coordinates.z, 1, 1, 0);
			}
			else
			{
				returnObja = NULL;
			}
		}
	}
	return ObjectHash;
}


Vector3 CombineVector(float x, float y, float z)
{
	Vector3 returnVector;
	returnVector.x = x;
	returnVector.y = y;
	returnVector.z = z;
	return returnVector;
}

