int changebyte(bool toggle)
{
	uintptr_t base_address = uintptr_t(GetModuleHandleA(nullptr));
	*((int*)(base_address + 0x254B9E8)) = toggle;
	*((int*)(base_address + 0x254B9E0)) = toggle;
	return 0;
}
