bool Features::fcbool = false;
void Features::FlyingCarLoop(bool toggle)
{ //linkhttps://msdn.microsoft.com/en-us/library/windows/desktop/dd375731(v=vs.85).aspx
	if (PED::IS_PED_IN_ANY_VEHICLE(PLAYER::PLAYER_PED_ID(), 0))
	{
		int Vehid = PED::GET_VEHICLE_PED_IS_IN(PLAYER::PLAYER_PED_ID(), 0);
		float Speed = ENTITY::GET_ENTITY_SPEED(Vehid);
		float pitch, roll = 0, yaw = 0;
		pitch = ENTITY::GET_ENTITY_PITCH(Vehid);
		if (GetAsyncKeyState(0x49)) //I key 
		{
			VEHICLE::SET_VEHICLE_FORWARD_SPEED(Vehid, Speed + 2);
		}
		if (GetAsyncKeyState(0x55))  //Ultra Up=U key,
		{
			ENTITY::APPLY_FORCE_TO_ENTITY(Vehid, 1, 0, 0, 20, 0, 0, 0, 1, false, true, true, true, true);
		}
		if (GetAsyncKeyState(0x4B)) //K key
		{
			VEHICLE::SET_VEHICLE_FORWARD_SPEED(Vehid, (Speed * -1) - 3);
		}
		if (GetAsyncKeyState(0x4A)) //Left=J key
		{
			Vector3 Rot = ENTITY::GET_ENTITY_ROTATION(Vehid, 2);
			Rot.z = Rot.z + 1.0;
			ENTITY::SET_ENTITY_ROTATION(Vehid, Rot.x, Rot.y, Rot.z, 2, 1);
		}
		if (GetAsyncKeyState(0x4C)) //Right=L key
		{
			Vector3 Rot = ENTITY::GET_ENTITY_ROTATION(Vehid, 2);
			Rot.z = Rot.z - 1.0;
			ENTITY::SET_ENTITY_ROTATION(Vehid, Rot.x, Rot.y, Rot.z, 2, 1);
		}
		if (GetAsyncKeyState(0x4E)) //Down=N key
		{
			ENTITY::SET_ENTITY_ROTATION(Vehid, 0.0f, roll, yaw, 2, FALSE);
			VEHICLE::SET_VEHICLE_FORWARD_SPEED(Vehid, 0);
		}
		if (GetAsyncKeyState(0x48)) //H key PITCH UP
		{
			ENTITY::SET_ENTITY_ROTATION(Vehid, pitch -= 4.5f, roll, yaw, 2, FALSE);
		}
		if (GetAsyncKeyState(0x47)) //G key PITCH DOWN
		{
			ENTITY::SET_ENTITY_ROTATION(Vehid, pitch += 4.5f, roll, yaw, 2, FALSE);
		}
		if (GetAsyncKeyState(0x39)) //9 key
		{
			float yaw2 = -45;
			ENTITY::SET_ENTITY_ROTATION(Vehid, pitch, roll, yaw2, 2, TRUE);
		}
		if (GetAsyncKeyState(0x38)) //8 key
		{
			float yaw3 = +45;
			ENTITY::SET_ENTITY_ROTATION(Vehid, pitch, roll, yaw3, 2, TRUE);
		}
		if (GetAsyncKeyState(0x37)) //7 key
		{
			float yaw4 = +90;
			ENTITY::SET_ENTITY_ROTATION(Vehid, pitch, roll, yaw4, 2, TRUE);
		}
		if (GetAsyncKeyState(0x30)) //0 key
		{
			float yaw5 = -90;
			ENTITY::SET_ENTITY_ROTATION(Vehid, pitch, roll, yaw5, 2, TRUE);
		}
		else
		{
			VEHICLE::SET_VEHICLE_GRAVITY(Vehid, TRUE);
		}
	}
}

