bool Features::rlbool3 = false;
void Features::HasPaintLoop3(bool toggle)
{
	if ((timeGetTime() - Features::TimePD2111) > 100) // Time between drops
	{
		RGBFade3();
		const int ElementAmount = 10;
		const int ArrSize = ElementAmount * 2 + 2;
		Vehicle *vehs = new Vehicle[ArrSize];
		vehs[0] = ElementAmount;
		int VehFound = PED::GET_PED_NEARBY_VEHICLES(PLAYER::PLAYER_PED_ID(), vehs);
		for (int i = 0; i < VehFound; i++)
		{
			int OffsetID = i * 2 + 2;
			if (vehs[OffsetID] != PED::GET_VEHICLE_PED_IS_IN(PLAYER::PLAYER_PED_ID(), false))
			{
				RequestControlOfEnt(vehs[OffsetID]);
				VEHICLE::SET_VEHICLE_CUSTOM_PRIMARY_COLOUR(vehs[OffsetID], r, g, b);
				VEHICLE::SET_VEHICLE_CUSTOM_SECONDARY_COLOUR(vehs[OffsetID], r, g, b);
			}
			Features::TimePD2111 = timeGetTime();
		}
		delete[] vehs;
	}
}

