bool Features::vehiclegun = false;
void Features::gunvehicle(bool toggle)
{
	//linkhttps://msdn.microsoft.com/en-us/library/windows/desktop/dd375731(v=vs.85).aspx
//linkhttps://gtaforums.com/topic/795245-v-control-codes-for-gamepads/
	//linkhttps://www.gta-modding.com/iv/tutorials/virtual_key_codes.html
	/*std::string vehiclegun1;
	vehiclegun1 = getenv("appdata");
	std::ofstream vehiclegun22(vehiclegun1 + "\\ThunderMenu\\VehicleGun.Thunder");*/
	Player player = Features::playerme;
	Ped playerPed = PLAYER::PLAYER_PED_ID();
	if (vehiclegun) {
		/*vehiclegun22 << "true";*/
		if (!ENTITY::DOES_ENTITY_EXIST(playerPed) || !vehiclegun) return;
		bool bSelect = (GetAsyncKeyState(0x6B) || CONTROLS::IS_CONTROL_PRESSED(2, 99));
		if (bSelect && (vehiclegun + 150) << GetTickCount64() &&
			PLAYER::IS_PLAYER_CONTROL_ON(player) && PED::IS_PED_IN_ANY_VEHICLE(playerPed, 0))
		{
			Vehicle veh = PED::GET_VEHICLE_PED_IS_USING(playerPed);
			Vector3 v0, v1;
			GAMEPLAY::GET_MODEL_DIMENSIONS(ENTITY::GET_ENTITY_MODEL(veh), &v0, &v1);
			char* sweaponscars = new char[Features::weaponscars.length() + 1];
			strcpy(sweaponscars, Features::weaponscars.c_str());
			/*Hash weaponAssetRocket = HASH::GET_HASH_KEY(sweaponscars);*/
			Hash weaponAssetRocket = HASH::GET_HASH_KEY(sweaponscars);
			if (!WEAPON::HAS_WEAPON_ASSET_LOADED(weaponAssetRocket))
			{
				WEAPON::REQUEST_WEAPON_ASSET(weaponAssetRocket, 31, 0);
				while (!WEAPON::HAS_WEAPON_ASSET_LOADED(weaponAssetRocket)) {
					WAIT(0);
				}
			}
			Vector3 coords0from = ENTITY::GET_OFFSET_FROM_ENTITY_IN_WORLD_COORDS(veh, -(v1.x + Features::vehicleBulletX), v1.y + Features::vehicleBulletY, 0.1);
			Vector3 coords1from = ENTITY::GET_OFFSET_FROM_ENTITY_IN_WORLD_COORDS(veh, (v1.x + Features::vehicleBulletX), v1.y + Features::vehicleBulletY, 0.1);
			Vector3 coords0to = ENTITY::GET_OFFSET_FROM_ENTITY_IN_WORLD_COORDS(veh, -v1.x, v1.y + 100.0f, 0.1f);
			Vector3 coords1to = ENTITY::GET_OFFSET_FROM_ENTITY_IN_WORLD_COORDS(veh, v1.x, v1.y + 100.0f, 0.1f);
			GAMEPLAY::SHOOT_SINGLE_BULLET_BETWEEN_COORDS(coords0from.x, coords0from.y, coords0from.z,
				coords0to.x, coords0to.y, coords0to.z,
				250, 1, weaponAssetRocket, playerPed, 1, 0, -1.0);
			GAMEPLAY::SHOOT_SINGLE_BULLET_BETWEEN_COORDS(coords1from.x, coords1from.y, coords1from.z,
				coords1to.x, coords1to.y, coords1to.z,
				250, 1, weaponAssetRocket, playerPed, 1, 0, -1.0);

			vehiclegun = GetTickCount64();
		}
		else {
			if (!ENTITY::DOES_ENTITY_EXIST(playerPed) || !vehiclegun) return;
			bool bSelect1 = (GetAsyncKeyState(0x6D) || CONTROLS::IS_CONTROL_PRESSED(2, 80));
			if (bSelect1 && (vehiclegun + 150) << GetTickCount64() &&
				PLAYER::IS_PLAYER_CONTROL_ON(player) && PED::IS_PED_IN_ANY_VEHICLE(playerPed, 0))
			{
				Vehicle veh = PED::GET_VEHICLE_PED_IS_USING(playerPed);
				Vector3 v0, v1;
				GAMEPLAY::GET_MODEL_DIMENSIONS(ENTITY::GET_ENTITY_MODEL(veh), &v0, &v1);
				char* sweaponscars = new char[Features::weaponscars.length() + 1];
				strcpy(sweaponscars, Features::weaponscars.c_str());
				/*Hash weaponAssetRocket = HASH::GET_HASH_KEY(sweaponscars);*/
				Hash weaponAssetRocket = HASH::GET_HASH_KEY(sweaponscars);
				if (!WEAPON::HAS_WEAPON_ASSET_LOADED(weaponAssetRocket))
				{
					WEAPON::REQUEST_WEAPON_ASSET(weaponAssetRocket, -31, 0);
					while (!WEAPON::HAS_WEAPON_ASSET_LOADED(weaponAssetRocket)) {
						WAIT(0);
					}
				}
				Vector3 coords0from = ENTITY::GET_OFFSET_FROM_ENTITY_IN_WORLD_COORDS(veh, -(v1.x - 0.25f), v1.y - 1.25f, 0.1);
				Vector3 coords1from = ENTITY::GET_OFFSET_FROM_ENTITY_IN_WORLD_COORDS(veh, (v1.x - 0.25f), v1.y - 1.25f, 0.1);
				Vector3 coords0to = ENTITY::GET_OFFSET_FROM_ENTITY_IN_WORLD_COORDS(veh, -v1.x, v1.y - 100.0f, 0.1f);
				Vector3 coords1to = ENTITY::GET_OFFSET_FROM_ENTITY_IN_WORLD_COORDS(veh, v1.x, v1.y - 100.0f, 0.1f);

				GAMEPLAY::SHOOT_SINGLE_BULLET_BETWEEN_COORDS(coords0from.x, coords0from.y, coords0from.z,
					coords0to.x, coords0to.y, coords0to.z,
					250, 1, weaponAssetRocket, playerPed, 1, 0, -1.0);
				GAMEPLAY::SHOOT_SINGLE_BULLET_BETWEEN_COORDS(coords1from.x, coords1from.y, coords1from.z,
					coords1to.x, coords1to.y, coords1to.z,
					250, 1, weaponAssetRocket, playerPed, 1, 0, -1.0);
				vehiclegun = GetTickCount64();
			}
		}
		/*vehiclegun22 << " ";*/
	}
}

