const float SHOOT_DISTANCE = 500.0f;
const float SHOOT_OFFSET = 1.0f;
const int SHOOT_DAMAGE = 50;
const int SHOOT_PENETRATION = 1;
const int SHOOT_FLAGS = 0xbf800000;

bool m_features::rapidfirer2 = false;
void m_features::rapidmaker() {
	if (!m_features::rapidfirer2)
		return;

	Player playerPed = PLAYER::PLAYER_PED_ID();
	if (PED::IS_PED_IN_ANY_VEHICLE(playerPed, 1)) {
		PLAYER::DISABLE_PLAYER_FIRING(playerPed, 1);
		return;
	}

	PLAYER::DISABLE_PLAYER_FIRING(playerPed, 1);
	Vector3 cameraPos = CAM::_GET_GAMEPLAY_CAM_COORDS();
	Vector3 cameraRot = CAM::GET_GAMEPLAY_CAM_ROT(0);
	Vector3 cameraDirection = RotationToDirection1(cameraRot);
	Vector3 shootPosition = addVector1(cameraPos, multiplyVector1(cameraDirection, SHOOT_OFFSET));
	Vector3 bulletEndPoint = addVector1(shootPosition, multiplyVector1(cameraDirection, SHOOT_DISTANCE));

	Hash weaponhash;
	WEAPON::GET_CURRENT_PED_WEAPON(playerPed, &weaponhash, 1);

	for (Ped ped : m_features::nearbyPeds(shootPosition, bulletEndPoint, 50.0f)) {
		if (ENTITY::IS_ENTITY_A_PED(ped) && ENTITY::DOES_ENTITY_EXIST(ped)) {
			PED::SET_PED_SHOOT_RATE(playerPed, 1000);
			GAMEPLAY::SHOOT_SINGLE_BULLET_BETWEEN_COORDS(shootPosition.x, shootPosition.y, shootPosition.z,
				bulletEndPoint.x, bulletEndPoint.y, bulletEndPoint.z, SHOOT_DAMAGE, SHOOT_PENETRATION,
				weaponhash, playerPed, 1, 1, SHOOT_FLAGS);
			break;
		}
	}
}

std::vector<Ped> m_features::nearbyPeds(Vector3 start, Vector3 end, float radius) {
	std::vector<Ped> result;
	int handle;
	Ped ped;

	handle = PED::CREATE_GROUP(0);
	PED::SET_GROUP_FORMATION(handle, 0);

	for (int i = 0; i < 32; i++) {
		if (i == PLAYER::PLAYER_ID())
			continue;

		ped = PLAYER::GET_PLAYER_PED(i);
		if (!ENTITY::DOES_ENTITY_EXIST(ped))
			continue;

		if (ENTITY::IS_ENTITY_DEAD(ped))
			continue;

		if (!PED::IS_PED_HUMAN(ped))
			continue;

		if (PED::IS_PED_IN_ANY_VEHICLE(ped, 1))
			continue;

		if (PED::IS_PED_IN_GROUP(ped))
			continue;
		float distance = GAMEPLAY::GET_DISTANCE_BETWEEN_COORDS(start.x, start.y, start.z, ENTITY::GET_ENTITY_COORDS(ped, true).x, ENTITY::GET_ENTITY_COORDS(ped, true).y, ENTITY::GET_ENTITY_COORDS(ped, true).z, true);

		if (distance > radius)
			continue;

		if (PED::IS_PED_FLEEING(ped))
			continue;

		if (!PED::IS_PED_STOPPED(ped))
			continue;

		if (PED::IS_PED_RAGDOLL(ped))
			continue;

		if (PED::IS_PED_IN_MELEE_COMBAT(ped))
			continue;

		if (PED::IS_PED_IN_COMBAT(ped, PLAYER::PLAYER_PED_ID()))
			continue;

		if (AI::IS_PED_RUNNING(ped))
			continue;

		if (AI::IS_PED_SPRINTING(ped))
			continue;

		if (!PED::IS_PED_USING_ANY_SCENARIO(ped))
			continue;

		PED::SET_PED_AS_GROUP_MEMBER(handle, ped);
		result.push_back(ped);
	}

	PED::REMOVE_GROUP(handle);

	return result;
}

void m_features::pedRape() {
	Ped playerPed = PLAYER::PLAYER_PED_ID();
	Vector3 playerPosition = ENTITY::GET_ENTITY_COORDS(playerPed, true);
	float radius = 10.0f;
	std::vector<Ped> nearbyPeds = m_features::nearbyPeds(playerPosition, playerPosition, radius);

	for (Ped ped : nearbyPeds) {
		AI::TASK_TURN_PED_TO_FACE_ENTITY(ped, playerPed, 500);
		AI::TASK_GO_TO_ENTITY(ped, playerPed, -1, 0, 2.0f, 2.0f, 0);
	}
}



