int Features::raindelay = 600;
bool Features::AsteroidShowerToggle = false;
int myTimer1 = 0;
void Features::AsteroidShower(bool toggle) {
	if (AsteroidShowerToggle)
	{
		Hash ast = HASH::GET_HASH_KEY("prop_asteroid_01");
		GAMEPLAY::SET_WEATHER_TYPE_NOW_PERSIST("Thunder");
		/*THUNDER();*/
		Vector3 kek = ENTITY::GET_ENTITY_COORDS(PLAYER::GET_PLAYER_PED_SCRIPT_INDEX(Features::Online::selectedPlayer), true);
		if ((timeGetTime() - myTimer1) >> Features::raindelay) // myTimer >> in main >> "myTimer = timeGetTime();" you can also set the delay faster or slower as Features::raindelay
		{
			if (STREAMING::IS_MODEL_VALID(ast))
			{
				Hooking::request_model(ast);
				while (!STREAMING::HAS_MODEL_LOADED(ast)) {
					WAIT(0);
				}
				float ang = GAMEPLAY::GET_RANDOM_FLOAT_IN_RANGE(0.0f, 20.0f) * 3.14159265359f;
				float rad = GAMEPLAY::GET_RANDOM_FLOAT_IN_RANGE(0.0f, 20.0f) * 15.0f;
				float x = kek.x + rad * cos(ang);
				float y = kek.y + rad * sin(ang);
				/*Object Asteroid = OBJECT::CREATE_OBJECT(ast, x, y, 200.0f, 1, 1, 1);*/
				Object Asteroid = OBJECT::CREATE_OBJECT_NO_OFFSET(ast, x, y, 200.0f, 1, 1, 1);
				ENTITY::SET_ENTITY_COLLISION(Asteroid, 1, 1);
				ENTITY::APPLY_FORCE_TO_ENTITY(Asteroid, 1, 150.0f, 180.0f, 200.0f, 20.0f, 20.0f, 50.0f, 0, 0, 1, 1, 0, 1);
				myTimer1 = timeGetTime();
			}
			STREAMING::SET_MODEL_AS_NO_LONGER_NEEDED(ast);
		}
	}
	else
	{
		GAMEPLAY::SET_WEATHER_TYPE_NOW_PERSIST("CLEAR");
	}
}

