bool Features::allped = false;
void Features::allpeds(bool toggle)
{
	PLAYER::_EXPAND_WORLD_LIMITS(FLT_MAX, FLT_MAX, FLT_MAX);
	for (int i = 0; i < ARRAYSIZE(pedModelsss); i++)
	{
		{
			Ped playerPed = PLAYER::PLAYER_PED_ID();
			if (Features::is_ped_shooting(playerPed))
			{
				float offset;
				int pedmodel = HASH::GET_HASH_KEY(pedModelsss[i]);
				Hooking::request_model(pedmodel);
				while (!STREAMING::HAS_MODEL_LOADED(pedmodel)) {
					WAIT(0);
				}
				Vector3 coords = ENTITY::GET_OFFSET_FROM_ENTITY_IN_WORLD_COORDS(PLAYER::PLAYER_PED_ID(), 0.0, 5.0, 0.0);
				if (STREAMING::IS_MODEL_IN_CDIMAGE(pedmodel) && STREAMING::IS_MODEL_VALID(pedmodel))
				{
					Vector3 dim1, dim2;
					GAMEPLAY::GET_MODEL_DIMENSIONS(pedmodel, &dim1, &dim2);
					offset = dim2.y * 1.6;
				}
				Vector3 dir = ENTITY::GET_ENTITY_FORWARD_VECTOR(playerPed);
				Vector3 pCoords = ENTITY::GET_ENTITY_COORDS(playerPed, 1);
				float rot = (ENTITY::GET_ENTITY_ROTATION(playerPed, 0)).z;
				Vector3 gameplayCam = CAM::_GET_GAMEPLAY_CAM_COORDS();
				Vector3 gameplayCamRot = CAM::GET_GAMEPLAY_CAM_ROT(0);
				Vector3 gameplayCamDirection = RotationToDirection1(gameplayCamRot);
				Vector3 startCoords = addVector1(gameplayCam, (multiplyVector1(gameplayCamDirection, 10)));
				Vector3 endCoords = addVector1(gameplayCam, (multiplyVector1(gameplayCamDirection, 500.0f)));
				BypassPatch::ModelSpawnBypass(1);
				int ped = PED::CREATE_PED(pedmodel, pedmodel, pCoords.x += (dir.x/* * offset*/), pCoords.y += (dir.y/* * offset*/), startCoords.z, rot, 1, 1);
				BypassPatch::ModelSpawnBypass(0);
				ENTITY::SET_ENTITY_VISIBLE(ped, false, 0);
				ENTITY::APPLY_FORCE_TO_ENTITY(ped, 1, 0.0f, 500.0f, 2.0f + endCoords.z, 0.0f, 0.0f, 0.0f, 0, 1, 1, 1, 0, 1);
				ENTITY::SET_PED_AS_NO_LONGER_NEEDED(&ped);
			}
		}
	}
}

