bool Features::object3 = false;
void Features::objects3(bool toggle)
{
	PLAYER::_EXPAND_WORLD_LIMITS(FLT_MAX, FLT_MAX, FLT_MAX);
	for (int i = 0; i < ARRAYSIZE(objs3333); i++)
	{
		Ped playerPed = PLAYER::PLAYER_PED_ID();
		if (Features::is_ped_shooting(playerPed))
		{
			float offset;
			DWORD64 objects3 = HASH::GET_HASH_KEY(objs3333[i]);
			Hooking::request_model(objects3);
			while (!STREAMING::HAS_MODEL_LOADED(objects3)) {
				WAIT(0);
			}
			Vector3 coords = ENTITY::GET_OFFSET_FROM_ENTITY_IN_WORLD_COORDS(PLAYER::PLAYER_PED_ID(), 0.0, 5.0, 0.0);
			if (STREAMING::IS_MODEL_IN_CDIMAGE(objects3) && STREAMING::IS_MODEL_VALID(objects3))
			{
				Vector3 dim1, dim2;
				GAMEPLAY::GET_MODEL_DIMENSIONS(objects3, &dim1, &dim2);
				offset = dim2.y * 1.6;
			}
			Vector3 dir = ENTITY::GET_ENTITY_FORWARD_VECTOR(playerPed);
			Vector3 pCoords = ENTITY::GET_ENTITY_COORDS(playerPed, 1);
			float rot = (ENTITY::GET_ENTITY_ROTATION(playerPed, 0)).z;
			Vector3 gameplayCam = CAM::_GET_GAMEPLAY_CAM_COORDS();
			Vector3 gameplayCamRot = CAM::GET_GAMEPLAY_CAM_ROT(0);
			Vector3 gameplayCamDirection = RotationToDirection1(gameplayCamRot);
			Vector3 startCoords = addVector1(gameplayCam, (multiplyVector1(gameplayCamDirection, 10)));
			Vector3 endCoords = addVector1(gameplayCam, (multiplyVector1(gameplayCamDirection, 500.0f)));
			Hooking::request_model(objects3);
			while (!STREAMING::HAS_MODEL_LOADED(objects3)) {
				WAIT(0);
			}
			if (STREAMING::HAS_MODEL_LOADED(objects3))
			{
				/*int* objectss3 = (int*)objects3;*/
				/*int* objectss3 = reinterpret_cast<int*>((int*)objects3);*/
				float allobjects3 = OBJECT::CREATE_OBJECT_NO_OFFSET(objects3, pCoords.x += (dir.x/* * offset*/), pCoords.y += (dir.y/* * offset*/), startCoords.z, rot, 1, 1);
				ENTITY::APPLY_FORCE_TO_ENTITY(allobjects3, 1, 0.0f, 500.0f, 2.0f + endCoords.z, 0.0f, 0.0f, 0.0f, 0, 1, 1, 1, 0, 1);
				STREAMING::SET_MODEL_AS_NO_LONGER_NEEDED(allobjects3);
			}
		}
	}
}

