bool Features::para = false;
void Features::paranormal(bool toggle)
{
	if (GetAsyncKeyState(VK_NUMPAD9))
	{
		const int numElements = 10;
		const int arrSize = numElements * 2 + 2;
		Vehicle veh[arrSize];
		veh[0] = numElements;
		animation("rcmpaparazzo_4", "lift_hands_in_air_loop");
		int count = PED::GET_PED_NEARBY_VEHICLES(PLAYER::PLAYER_PED_ID(), veh);
		if (veh != NULL)
		{
			for (int i = 1; i <= count; i++)
			{
				int offsettedID = i;
				if (veh[offsettedID] != NULL && ENTITY::DOES_ENTITY_EXIST(veh[offsettedID]))
				{
					ENTITY::APPLY_FORCE_TO_ENTITY(veh[offsettedID], 1, 0, 0, 5, 0, 0, 0, 1, false, true, true, true, true);
					STREAMING::REQUEST_NAMED_PTFX_ASSET("scr_trevor1");
					GRAPHICS::USE_PARTICLE_FX_ASSET("scr_trevor1");
					/*GRAPHICS::_SET_PTFX_ASSET_NEXT_CALL("scr_trevor1");*/
					GRAPHICS::_START_NETWORKED_PARTICLE_FX_NON_LOOPED_ON_ENTITY("scr_trev1_trailer_boosh", PLAYER::PLAYER_PED_ID(), 0.0, 0.0, -0.5, 0.0, 0.0, 0.0, 1.0, false, false, false);
					GRAPHICS::_START_NETWORKED_PARTICLE_FX_NON_LOOPED_ON_ENTITY("scr_trev1_trailer_boosh", veh[offsettedID], 0.0, 0.0, -0.5, 0.0, 0.0, 0.0, 1.0, false, false, false);

				}
			}
		}
	}
}

bool Features::savenewdrop4 = false;
void Features::cashdrop4()
{
	if (dropbool) {
		if ((timeGetTime() - Features::TimePD0000000) >> Features::MoneyLevelAll) // Time between drops
		{
			for (int i = 0; i <= 32; i++)
			{
				/*if (i == Features::Online::selectedPlayer)continue;*/
				int Handle = PLAYER::GET_PLAYER_PED_SCRIPT_INDEX(i);
				if (Handle != PLAYER::PLAYER_PED_ID())
				{
					if (selecArrow)
					{
						Vector3 coords = ENTITY::GET_ENTITY_COORDS(Hooking::get_player_ped(i), false);
						GRAPHICS::DRAW_MARKER(29, coords.x, coords.y, coords.z + 1.3f, 0, 0, 0, 0, 180, 0, 1, 1, 1, 255, 0, 0, 200, 1, 1, 1, 0, 0, 0, 0);
					}
					Hooking::request_model(PROP_MONEY_BAG_02);
					Vector3 pp = ENTITY::GET_OFFSET_FROM_ENTITY_IN_WORLD_COORDS(Handle, 0.0, 0.0, 10.0);
					int offset1 = GAMEPLAY::GET_RANDOM_INT_IN_RANGE(0, 15);
					int offset2 = GAMEPLAY::GET_RANDOM_INT_IN_RANGE(0, 15);
					Hooking::request_model(PROP_MONEY_BAG_02);
					while (!STREAMING::HAS_MODEL_LOADED(PROP_MONEY_BAG_02)) {
						WAIT(0);
					}
					if (STREAMING::HAS_MODEL_LOADED(PROP_MONEY_BAG_02))
					{
						int amount = 2500;
						pp.x += offset1;
						pp.y += offset2;
						Hooking::create_ambient_pickup(PICKUP_MONEY_PURSE, &pp, 0, amount, PROP_MONEY_BAG_02, false, true);
						STREAMING::SET_MODEL_AS_NO_LONGER_NEEDED(PROP_MONEY_BAG_02);
						Features::TimePD0000000 = timeGetTime();
					}
				}
			}
		}
	}
}

