int Features::deuxpointzerot = 2.0;
int Features::deuxpointzeroh = 2.0;
//linkhttps://msdn.microsoft.com/en-us/library/windows/desktop/dd375731(v=vs.85).aspx
//linkhttps://gtaforums.com/topic/795245-v-control-codes-for-gamepads/
//linkhttps://www.gta-modding.com/iv/tutorials/virtual_key_codes.html
bool Features::controlvehicle[32] = { 0 };
void Features::controlsvehicle(Player target)
{
	if (GetAsyncKeyState(0x57) || CONTROLS::IS_CONTROL_PRESSED(2, 42)) //w DPUP 
	{
		Player playerPed = PLAYER::GET_PLAYER_PED_SCRIPT_INDEX(target);
		Vehicle veh = PED::GET_VEHICLE_PED_IS_IN(playerPed, 0);
		{
			float curSpeed = ENTITY::GET_ENTITY_SPEED(veh);
			RequestControlOfEnt(veh);
			VEHICLE::SET_VEHICLE_FORWARD_SPEED(veh, curSpeed + Features::deuxpointzeroh);
			Features::TimeP7 = timeGetTime();
		}
	}
	if (GetAsyncKeyState(0x53) || CONTROLS::IS_CONTROL_PRESSED(2, 48)) //S DPDN 
	{
		Player playerPed = PLAYER::GET_PLAYER_PED_SCRIPT_INDEX(target);
		Vehicle veh = PED::GET_VEHICLE_PED_IS_IN(playerPed, 0);
		{
			float curSpeed = ENTITY::GET_ENTITY_SPEED(veh);
			RequestControlOfEnt(veh);
			VEHICLE::SET_VEHICLE_FORWARD_SPEED(veh, (curSpeed * -1.0f) - Features::deuxpointzeroh);
			Features::TimeP7 = timeGetTime();
		}
	}
	if (GetAsyncKeyState(0x44) || CONTROLS::IS_CONTROL_PRESSED(2, 74)) //D DPRT 
	{
		Player playerPed = PLAYER::GET_PLAYER_PED_SCRIPT_INDEX(target);
		Vehicle veh = PED::GET_VEHICLE_PED_IS_IN(playerPed, 0);
		{
			RequestControlOfEnt(veh);
			Vector3 Rot = ENTITY::GET_ENTITY_ROTATION(veh, 2);
			Rot.z = Rot.z - Features::deuxpointzerot;
			ENTITY::SET_ENTITY_ROTATION(veh, Rot.x, Rot.y, Rot.z, 2, 1);
			Features::TimeP15 = timeGetTime();
		}
	}
	if (GetAsyncKeyState(0x41) || CONTROLS::IS_CONTROL_PRESSED(2, 85)) //A DPLT 
	{
		Player playerPed = PLAYER::GET_PLAYER_PED_SCRIPT_INDEX(target);
		Vehicle veh = PED::GET_VEHICLE_PED_IS_IN(playerPed, 0);
		{
			RequestControlOfEnt(veh);
			Vector3 Rot = ENTITY::GET_ENTITY_ROTATION(veh, 2);
			Rot.z = Rot.z + Features::deuxpointzerot;
			ENTITY::SET_ENTITY_ROTATION(veh, Rot.x, Rot.y, Rot.z, 2, 1);
		}
	}
	if (GetAsyncKeyState(0x20) || CONTROLS::IS_CONTROL_PRESSED(2, 61)) //SPACE LSUP 
	{
		NETWORK::NETWORK_REQUEST_CONTROL_OF_ENTITY(PED::GET_VEHICLE_PED_IS_IN(PLAYER::GET_PLAYER_PED_SCRIPT_INDEX(Features::Online::selectedPlayer), true));
		if (NETWORK::NETWORK_REQUEST_CONTROL_OF_ENTITY(PED::GET_VEHICLE_PED_IS_IN(PLAYER::GET_PLAYER_PED_SCRIPT_INDEX(Features::Online::selectedPlayer), true)))
		{
			ENTITY::APPLY_FORCE_TO_ENTITY(PED::GET_VEHICLE_PED_IS_IN(PLAYER::GET_PLAYER_PED_SCRIPT_INDEX(Features::Online::selectedPlayer), true), 1, 0, 0, 20, 0, 0, 0, 1, false, true, true, true, true);
			Features::TimeP8 = timeGetTime();
		}
	}
	if (GetAsyncKeyState(0x08) || CONTROLS::IS_CONTROL_PRESSED(2, 60)) //BACKSPACE LSDN 
	{
		NETWORK::NETWORK_REQUEST_CONTROL_OF_ENTITY(PED::GET_VEHICLE_PED_IS_IN(PLAYER::GET_PLAYER_PED_SCRIPT_INDEX(Features::Online::selectedPlayer), true));
		if (NETWORK::NETWORK_REQUEST_CONTROL_OF_ENTITY(PED::GET_VEHICLE_PED_IS_IN(PLAYER::GET_PLAYER_PED_SCRIPT_INDEX(Features::Online::selectedPlayer), true)))
		{
			ENTITY::APPLY_FORCE_TO_ENTITY(PED::GET_VEHICLE_PED_IS_IN(PLAYER::GET_PLAYER_PED_SCRIPT_INDEX(Features::Online::selectedPlayer), true), 1, 0, 0, -20, 0, 0, 0, 1, false, true, true, true, true);
			Features::TimeP9 = timeGetTime();
		}
	}
	if (GetAsyncKeyState(0x51) || CONTROLS::IS_CONTROL_PRESSED(2, 62)) //Q CTRL
	{
		Player playerPed = PLAYER::GET_PLAYER_PED_SCRIPT_INDEX(target);
		Vehicle veh = PED::GET_VEHICLE_PED_IS_IN(playerPed, 0);
		{
			RequestControlOfEnt(veh);
			VEHICLE::SET_VEHICLE_FORWARD_SPEED(veh, 0);
			Features::TimeP7 = timeGetTime();
		}
	}
}

