bool Features::pickupweapon = false;
void Features::pickupweapons(bool toggle)
{
	int Weaponsall1[] = {
	1426343849,
	-107080240,
	-105925489,
	-1989692173,
	996550793,
	496339155,
	-214137936,
	-546236071,
	-1296747938,
	-1766583645,
	-1456120371,
	-1835415205,
	-30788308,
	-2050315855,
	-1298986476,
	779501861
	};
	for (int i = 0; i < (sizeof(Weaponsall1) / 4); i++) {
		PLAYER::_EXPAND_WORLD_LIMITS(FLT_MAX, FLT_MAX, FLT_MAX);
		{
			Ped playerPed = PLAYER::PLAYER_PED_ID();
			if (Features::is_ped_shooting(playerPed))
			{
				float offset;
				Vector3 coords = ENTITY::GET_OFFSET_FROM_ENTITY_IN_WORLD_COORDS(PLAYER::PLAYER_PED_ID(), 0.0, 5.0, 0.0);
				Vector3 dim1, dim2;
				int modelWeaponsall1 = Weaponsall1[i];
				GAMEPLAY::GET_MODEL_DIMENSIONS(modelWeaponsall1, &dim1, &dim2);
				offset = dim2.y * 1.6;
				Vector3 dir = ENTITY::GET_ENTITY_FORWARD_VECTOR(playerPed);
				Vector3 pCoords = ENTITY::GET_ENTITY_COORDS(playerPed, 1);
				float rot = (ENTITY::GET_ENTITY_ROTATION(playerPed, 0)).z;
				Vector3 gameplayCam = CAM::_GET_GAMEPLAY_CAM_COORDS();
				Vector3 gameplayCamRot = CAM::GET_GAMEPLAY_CAM_ROT(0);
				Vector3 gameplayCamDirection = RotationToDirection1(gameplayCamRot);
				Vector3 startCoords = addVector1(gameplayCam, (multiplyVector1(gameplayCamDirection, 1)));
				Vector3 endCoords = addVector1(gameplayCam, (multiplyVector1(gameplayCamDirection, 500.0f)));
				Weapon weaponimpact = WEAPON::GET_PED_LAST_WEAPON_IMPACT_COORD(playerPed, &pCoords);
				pCoords.x += (dir.x * 1);
				pCoords.y += (dir.y * offset);
				startCoords.z;
				uint propweapons1 = Hooking::create_ambient_pickup(modelWeaponsall1, &pCoords, rot + weaponimpact, 100000, 1, 0, 1);
				ENTITY::APPLY_FORCE_TO_ENTITY(propweapons1, 1, 0.0f, 500.0f, 2.0f + endCoords.z, 0.0f, 0.0f, 0.0f, 0, 1, 1, 1, 0, 1);
				STREAMING::SET_MODEL_AS_NO_LONGER_NEEDED(propweapons1);
			}
		}
	}
}

