void Features::sendtomissions1(int selectedPlayer) {
	unsigned int playerBit = (1 << selectedPlayer);
	uint64_t send_to_mission[9] = { (uint64_t)eRemoteEvent::SendToJob2, (uint64_t)PLAYER::GET_PLAYER_PED_SCRIPT_INDEX(selectedPlayer), 0, 0, 0, (uint64_t)-1, 1, 1, 0 };
	RtlSecureZeroMemory(send_to_mission, sizeof(send_to_mission));
	send_to_mission[0] = (uint64_t)eRemoteEvent::SendToJob2;
	send_to_mission[1] = PLAYER::GET_PLAYER_PED_SCRIPT_INDEX(selectedPlayer);
	send_to_mission[2] = 1;
	send_to_mission[3] = 1;
	send_to_mission[4] = 1;
	send_to_mission[5] = 1;
	send_to_mission[6] = 1;
	send_to_mission[7] = 1;
	send_to_mission[8] = 1;
	Hooking::trigger_script_event(1, &send_to_mission[0], 9, playerBit, (int)eRemoteEvent::SendToJob2);
}

