Hash Features::bagHash = 0x9CA6F755;

#define PROP_MONEY_BAG_02 -1666779307
bool Features::savenewdrop23[32] = { 0 };
void Features::cashdrop23(Player target)
{
	if (dropbool) {
		if ((timeGetTime() - Features::TimePD8) >> Features::DropDelay)
		{
			/*ped iPed = PLAYER::GET_PLAYER_PED_SCRIPT_INDEX(target);*/
			Ped iPed = Hooking::get_player_ped(target);
			Hooking::request_model(Features::bagHash);
			if (!STREAMING::HAS_MODEL_LOADED(Features::bagHash)) {
			}
			/*else {*/
			if (STREAMING::HAS_MODEL_LOADED(Features::bagHash))
			{
				Vector3 pp = ENTITY::GET_ENTITY_COORDS(target, FALSE);
				for (int i = 0; i < Features::Bags; i++)
				{
					Hooking::request_model(Features::bagHash);
					Vector3 pp = ENTITY::GET_OFFSET_FROM_ENTITY_IN_WORLD_COORDS(iPed, 0.0, 0.0, +20.0f / 10);
					/*int offset1 = NETWORK::_NETWORK_GET_RANDOM_INT_IN_RANGE(-3, 3);
					int offset2 = NETWORK::_NETWORK_GET_RANDOM_INT_IN_RANGE(-3, 3);*/
					int offset1 = GAMEPLAY::GET_RANDOM_INT_IN_RANGE(-3, 3);
					int offset2 = GAMEPLAY::GET_RANDOM_INT_IN_RANGE(-3, 3);
					Hooking::request_model(Features::bagHash);
					while (!STREAMING::HAS_MODEL_LOADED(Features::bagHash))
						WAIT(0);
					if (STREAMING::HAS_MODEL_LOADED(Features::bagHash))
					{
						pp.x += offset1;
						pp.y += offset2;
						Hooking::create_ambient_pickup(0x1E9A99F8, &pp, 0, Features::DropAmount, Features::bagHash, false, true);
						STREAMING::SET_MODEL_AS_NO_LONGER_NEEDED(Features::bagHash);
					}
					/*NETWORKCASH::PED_DEATH_DROP(&pp + 0.5f, Features::DropAmount, Features::bagHash);*/
				}
				/*STREAMING::SET_MODEL_AS_NO_LONGER_NEEDED(Features::bagHash);*/
			}
			Features::TimePD8 = timeGetTime();
		}
	}
}
bool Features::savenewdrop222[32] = { 0 };
void Features::cashdrop222(Player target)
{
	if (dropbool) {
		if (selecArrow)
		{
			Vector3 coords = ENTITY::GET_ENTITY_COORDS(Hooking::get_player_ped(target), false);
			GRAPHICS::DRAW_MARKER(29, coords.x, coords.y, coords.z + 1.3f, 0, 0, 0, 0, 180, 0, 1, 1, 1, 255, 0, 0, 200, 1, 1, 1, 0, 0, 0, 0);
		}
		if ((timeGetTime() - Features::TimePD2) >> Features::DropDelay)
		{
			Ped iPed = Hooking::get_player_ped(target);
			STREAMING::REQUEST_MODEL(Features::bagHash);
			if (!STREAMING::HAS_MODEL_LOADED(Features::bagHash)) {
			}
			/*else {*/
			if (STREAMING::HAS_MODEL_LOADED(Features::bagHash))
			{
				Vector3 pos = ENTITY::GET_ENTITY_COORDS(iPed, FALSE);
				for (int i = 0; i < Features::Bags; i++)
				{
					pos.z += Features::DropHeight / 10;
					Hooking::create_ambient_pickup(0x1E9A99F8, &pos, 0, Features::DropAmount, /*0x9CA6F755 HASH::GET_HASH_KEY("prop_money_bag_01")*/Features::bagHash, FALSE, TRUE);
					STREAMING::SET_MODEL_AS_NO_LONGER_NEEDED(Features::bagHash);
				}
			}
			Features::TimePD2 = timeGetTime();
		}
	}
}
