void Features::PlaceObjectByHash(Hash hash, float xa, float ya, float za, float pitcha, float rolla, float yawa, float headinga, int ida)
{
	if (STREAMING::IS_MODEL_IN_CDIMAGE(hash)) {
		Hooking::request_model(hash);
		while (!STREAMING::HAS_MODEL_LOADED(hash)) WAIT(0);
		//DWORD64 hashing = hash;
		//int* hashcode = reinterpret_cast<int*>(/*(int*)*/hashing);
		Object obj = OBJECT::CREATE_OBJECT_NO_OFFSET(hash, xa, ya, za, 1, 0, 0);
		/*Object obj = OBJECT::CREATE_OBJECT_NO_OFFSET(hashcode, xa, ya, za, 1, 0, 0);*/
		/*int* hashcode = (int*)hash;*/
		/*float obj = OBJECT::CREATE_OBJECT_NO_OFFSET(hashcode, xa, ya, za, 1, 0, 0);*/
		/*ENTITY::SET_ENTITY_HEADING(obj, heading);
		ENTITY::SET_ENTITY_ROTATION(obj, pitch, roll, yaw, 2, 1);*/
		ENTITY::SET_ENTITY_LOD_DIST(obj, 696969);
		STREAMING::SET_MODEL_AS_NO_LONGER_NEEDED(obj);
		ENTITY::FREEZE_ENTITY_POSITION(obj, 1);
		ENTITY::SET_ENTITY_ROTATION(obj, pitcha, rolla, yawa, 0, 1);
		mapMods[mapModsIndex] = obj;
		if (mapModsIndex <= 250) mapModsIndex++;
		WAIT(25);
	}
}

