void Features::set_no_clip()
{
	/*if (stoppednoclip)*/
		if (Spooner::SpoonerMode::bEnabled)
		return;

	auto& cam = g_cam_noClip;
	GTAentity myPed = PLAYER::PLAYER_PED_ID();
	/*Player player = Features::playerme;*/
	GTAplayer myPlayer = /*PLAYER::PLAYER_ID()*/Features::playerme;
	GTAentity ent = PED::IS_PED_IN_ANY_VEHICLE(myPed.Handle(), false) ? PED::GET_VEHICLE_PED_IS_IN(myPed.Handle(), false) : myPed;

	if (ent.Exists())
	{
		if (/*Menu3::bit_controller ? (CONTROLS::IS_CONTROL_PRESSED(2, INPUT_FRONTEND_X) && CONTROLS::IS_CONTROL_JUST_PRESSED(2, INPUT_FRONTEND_LS)) : */GetAsyncKeyState(0x72)/*IsKeyJustUp(Features::bind_no_clip)*/)
		{
			loop_no_clip_toggle = !loop_no_clip_toggle;
			if (!loop_no_clip_toggle)
			{
				set_no_clip_off1();
			}
			else
			{
				/*if (bit_noclip_show_help)
				{
					bit_noclip_show_help = false;

					if (Menu3::bit_controller) Game::CustomHelpText::ShowTimedText(oss_ << "FreeCam:~n~~INPUT_MOVE_UD~ = " << Game::GetGXTEntry("ITEM_MOV_CAM")
						<< "~n~~INPUT_LOOK_LR~ = " << Game::GetGXTEntry("ITEM_MOV_CAM") << "~n~~INPUT_FRONTEND_RT~/~INPUT_FRONTEND_LT~ = " << "Ascend/Descend" << "~n~~INPUT_FRONTEND_RB~ = " << "Hasten", 6000);
					else Game::CustomHelpText::ShowTimedText(oss_ << "FreeCam:~n~~INPUT_MOVE_UD~/~INPUT_MOVE_LR~ = " << Game::GetGXTEntry("ITEM_MOV_CAM")
						<< "~n~~INPUT_LOOK_LR~ = " << Game::GetGXTEntry("ITEM_MOV_CAM") << "~n~~INPUT_PARACHUTE_BRAKE_RIGHT~/~INPUT_PARACHUTE_BRAKE_LEFT~ = " << "Ascend/Descend" << "~n~~INPUT_SPRINT~ = " << "Hasten", 6000);
				}*/
				bit_noclip_already_invis = !ent.IsVisible();
				bit_noclip_already_collis = ent.IsCollisionEnabled_get();
				//if (IS_ENTITY_A_PED(tempEntity)) task_HandsUp(tempEntity);
			}
		}

		if (!loop_no_clip_toggle)
		{
			set_no_clip_off2();
			return;
		}

		CONTROLS::DISABLE_CONTROL_ACTION(2, INPUT_VEH_HORN, TRUE);
		CONTROLS::DISABLE_CONTROL_ACTION(2, INPUT_LOOK_BEHIND, TRUE);
		CONTROLS::DISABLE_CONTROL_ACTION(2, INPUT_VEH_LOOK_BEHIND, TRUE);
		CONTROLS::DISABLE_CONTROL_ACTION(2, INPUT_SELECT_WEAPON, TRUE);
		CONTROLS::DISABLE_CONTROL_ACTION(2, INPUT_VEH_ACCELERATE, TRUE);
		CONTROLS::DISABLE_CONTROL_ACTION(2, INPUT_VEH_BRAKE, TRUE);
		CONTROLS::DISABLE_CONTROL_ACTION(2, INPUT_VEH_RADIO_WHEEL, TRUE);

		Vector31& entPos = ent.Position_get();
		Vector31& camOffset = Vector31();//Vector3(0, -4.0f, 3.6f);

		if (!cam.Exists())
		{
			ent.RequestControl();
			cam = World::CreateCamera();
			cam.Position_set(Position_get());
			cam.Rotation_set(Rotation_get());
			cam.AttachTo(ent, camOffset);
			cam.FieldOfView_set(FieldOfView_get());
			cam.DepthOfFieldStrength_set(0.0f);
			World::RenderingCamera_set(cam);
		}

		ent.RequestControl();
		//ent.Position_set(cam.GetOffsetInWorldCoords(-camOffset));
		ent.FreezePosition(true);
		ent.IsCollisionEnabled_set(false);
		ent.SetVisible(false);
		myPed.SetVisible(false);

		Vector31& nextRot = cam.Rotation_get() - Vector31(CONTROLS::GET_DISABLED_CONTROL_NORMAL(0, INPUT_LOOK_UD), 0, CONTROLS::GET_DISABLED_CONTROL_NORMAL(0, INPUT_LOOK_LR)) * (Menu3::bit_controller ? 2.5f : 11.0f);
		nextRot.y1 = 0.0f; // No roll
		ent.Rotation_set(Vector31(0, 0, nextRot.z1));
		cam.Rotation_set(nextRot);
		if (!myPlayer.IsFreeAiming() && !myPlayer.IsTargetingAnything())
			CAM::SET_GAMEPLAY_CAM_RELATIVE_HEADING(0.0f);

		if (Menu3::bit_controller)
		{
			CONTROLS::DISABLE_CONTROL_ACTION(0, INPUT_VEH_HORN, TRUE);

			if (ent == myPed)
			{
				if (PED::GET_PED_STEALTH_MOVEMENT(myPed.Handle()))
					PED::SET_PED_STEALTH_MOVEMENT(myPed.Handle(), false, 0);
				if (PED::GET_PED_COMBAT_MOVEMENT(myPed.Handle()))
					PED::SET_PED_COMBAT_MOVEMENT(myPed.Handle(), 0);
			}
			float noclip_prec_level = CONTROLS::IS_DISABLED_CONTROL_PRESSED(2, INPUT_FRONTEND_RB) ? 1.8f : 0.8f;
			Vector31 offset;
			offset.x1 = CONTROLS::GET_CONTROL_NORMAL(0, INPUT_MOVE_LR) * noclip_prec_level;
			offset.y1 = -CONTROLS::GET_CONTROL_NORMAL(0, INPUT_MOVE_UD) * noclip_prec_level;
			offset.z1 = (CONTROLS::GET_DISABLED_CONTROL_NORMAL(2, INPUT_FRONTEND_RT) - CONTROLS::GET_DISABLED_CONTROL_NORMAL(2, INPUT_FRONTEND_LT)) * noclip_prec_level;
			if (!offset.IsZero())
				ent.Position_set(cam.GetOffsetInWorldCoords(offset - camOffset));
			else
			{
				float noclip_prec_level = CONTROLS::IS_DISABLED_CONTROL_PRESSED(0, INPUT_SPRINT) ? 1.77f : 0.35f;
				Vector31 offset;
				offset.x1 = CONTROLS::GET_CONTROL_NORMAL(0, INPUT_MOVE_LR) * noclip_prec_level;
				offset.y1 = -CONTROLS::GET_CONTROL_NORMAL(0, INPUT_MOVE_UD) * noclip_prec_level;
				offset.z1 = CONTROLS::IS_DISABLED_CONTROL_PRESSED(2, INPUT_PARACHUTE_BRAKE_RIGHT) ? noclip_prec_level : CONTROLS::IS_DISABLED_CONTROL_PRESSED(2, INPUT_PARACHUTE_BRAKE_LEFT) ? -noclip_prec_level : 0.0f;
				if (!offset.IsZero())
					ent.Position_set(cam.GetOffsetInWorldCoords(offset - camOffset));
			}
		}
	}
}
