bool Features::loop_self_resurrectionGun = 0;
void Features::set_self_resurrectionGun()
{
	getweapons();
	if (g_myWeap != 0U)
	{
		GTAentity myPed = PLAYER::PLAYER_PED_ID();
		if (/*IS_PED_SHOOTING*/Features::is_ped_shooting(myPed.Handle()))
		{
			GTAped targPed = World::EntityFromAimCamRay();

			if (targPed.IsPed() && targPed.IsDead())
			{
				targPed.RequestControl();
				targPed.Health_set(200);
				PED::RESURRECT_PED(targPed.Handle());
				PED::REVIVE_INJURED_PED(targPed.Handle());
				targPed.MaxHealth_set(400);
				targPed.Health_set(200);
				PED::SET_PED_GENERATES_DEAD_BODY_EVENTS(targPed.Handle(), false);
				PED::SET_PED_CONFIG_FLAG(targPed.Handle(), 166, 0);
				PED::SET_PED_CONFIG_FLAG(targPed.Handle(), 187, 0);

				targPed.Task().ClearAllImmediately();
				TaskSequence2 seq;
				seq.AddTask().PlayAnimation("get_up@directional@movement@from_knees@standard", rand() % 3 == 1 ? "getup_r_90" : "getup_l_90", 8.0f, -8.0f, -1, AnimFlag::SecondTask, 0, false);
				seq.AddTask().WanderAround();
				seq.Close();
				seq.MakePedPerform(targPed);
				seq.Clear();
			}
		}
	}
}

