//int Features::vehicle_fly_speed = 1;
bool Features::vehi_fly = false;
int Features::travelSpeed = 1;
bool Features::flyingcars_ = 0;
void Features::_FlyingCars(bool toggle)
{
	if (Features::flyingcars_)
	{
	float forwardPush;
	switch (Features::travelSpeed)
	{
	case 0:
		forwardPush = 2.8f; //medium
		break;
	case 1:
		forwardPush = 4.3f; //fast
		break;
	case 2:
		forwardPush = 7.4f;//4.3f; //very fast
		break;
	case 3:
		forwardPush = 13.8f; //extremely fast
		break;
	case 4:
		forwardPush = 0.3;//0.08f; //very slow
		break;
	case 5:
		forwardPush = 0.8f; //slow
		break;
	}
	if (GetAsyncKeyState(VK_CONTROL))
	{
		Features::travelSpeed++;
		if (Features::travelSpeed > 5)
		{
			Features::travelSpeed = 0;
		}
	}
	bool opencontroller = (CONTROLS::IS_DISABLED_CONTROL_JUST_PRESSED(2, flyingcars::open) & 1);
	if (GetAsyncKeyState(VK_F2) || opencontroller) //0x4F VK_KEY_O Controller DPDN_48
	{
		Features::vehi_fly = !Features::vehi_fly;
		Sleep(100);
	}
	if (Features::vehi_fly)
	{
		unfreezebool = true;
		Vector3 rot = CAM::GET_GAMEPLAY_CAM_ROT(0);
		int vehicle_id = PED::GET_VEHICLE_PED_IS_IN(PLAYER::PLAYER_PED_ID(), 0);
		float vehicle_speed = ENTITY::GET_ENTITY_SPEED(vehicle_id);
		/*Vector3 Rots = ENTITY::GET_ENTITY_ROTATION(vehicle_id, 2);*/
		ENTITY::FREEZE_ENTITY_POSITION(vehicle_id, false);
		/*float heading = ENTITY::GET_ENTITY_FORWARD_Y(vehicle_id);*/

		bool flyingcarsdown = (CONTROLS::IS_DISABLED_CONTROL_JUST_PRESSED(2, flyingcars::down) & 1);
		bool flyingcarsup = (CONTROLS::IS_DISABLED_CONTROL_JUST_PRESSED(2, flyingcars::up) & 1);
		if (PED::IS_PED_IN_ANY_VEHICLE(PLAYER::PLAYER_PED_ID(), 0))
		{
			ENTITY::SET_ENTITY_ROTATION(vehicle_id, rot.x, rot.y, rot.z, 2, 1);
			if (GetAsyncKeyState(VK_KEY_W) || CONTROLS::IS_DISABLED_CONTROL_JUST_PRESSED(2, flyingcars::up) & 1) //0x57 VK_KEY_W
			{
				ENTITY::FREEZE_ENTITY_POSITION(vehicle_id, false);
				VEHICLE::SET_VEHICLE_FORWARD_SPEED(vehicle_id, vehicle_speed + forwardPush);
			}
			if (GetAsyncKeyState(VK_KEY_S) || CONTROLS::IS_DISABLED_CONTROL_JUST_PRESSED(2, flyingcars::down) & 1) //0x53 VK_KEY_S
			{
				ENTITY::FREEZE_ENTITY_POSITION(vehicle_id, false);
				VEHICLE::SET_VEHICLE_FORWARD_SPEED(vehicle_id, (vehicle_speed * -1.0f) - forwardPush);
			}
			if (GetAsyncKeyState(VK_KEY_A))
			{
				ENTITY::FREEZE_ENTITY_POSITION(vehicle_id, false);
				ENTITY::APPLY_FORCE_TO_ENTITY(vehicle_id, 1, 0, 2, 0, 0, 0, 0, 1, false, true, true, true, true);
			}
			if (GetAsyncKeyState(VK_KEY_D))
			{
				ENTITY::FREEZE_ENTITY_POSITION(vehicle_id, false);
				ENTITY::APPLY_FORCE_TO_ENTITY(vehicle_id, 1, 0, -2, 0, 0, 0, 0, 1, false, true, true, true, true);
			}
			if (GetAsyncKeyState(VK_SHIFT))
			{
				ENTITY::FREEZE_ENTITY_POSITION(vehicle_id, false);
				ENTITY::APPLY_FORCE_TO_ENTITY(vehicle_id, 1, 0, 0, -2, 0, 0, 0, 1, false, true, true, true, true);
			}
			if (GetAsyncKeyState(VK_SPACE))
			{
				ENTITY::FREEZE_ENTITY_POSITION(vehicle_id, false);
				ENTITY::APPLY_FORCE_TO_ENTITY(vehicle_id, 1, 0, 0, 2, 0, 0, 0, 1, false, true, true, true, true);
			}
			else 
			{ 
				if (!GetAsyncKeyState(VK_KEY_S) && !flyingcarsdown && !GetAsyncKeyState(VK_KEY_W) && !flyingcarsup && !GetAsyncKeyState(VK_KEY_A) && !GetAsyncKeyState(VK_KEY_D) && !GetAsyncKeyState(VK_SHIFT) && !GetAsyncKeyState(VK_SPACE) && !GetAsyncKeyState(VK_CONTROL))
			{
				ENTITY::FREEZE_ENTITY_POSITION(vehicle_id, true);
			}
			}
		}
	}
	}
	if (!Features::flyingcars_)
	{
		Features::vehi_fly = false;
	if (!Features::vehi_fly)
	{
		if (unfreezebool)
		{
			std::this_thread::sleep_for(std::chrono::milliseconds(1));
			Features::unfreeze_vehicle();
			unfreezebool = false;
		}
	}
	}
}

