bool droptimer2::getbackbool2 = false;
void droptimer2::newdroptimer()
{
	if (droptimer2::getboolBack)
	{
		DWORD ticks = GetTickCount64();
		DWORD milliseconds = ticks % 1000;
		//ticks /= 1000;
		//DWORD seconds = ticks % 60;
		//ticks /= 60;
		//DWORD minutes = ticks % 60;
		//ticks /= 60;
		//DWORD hours = ticks; // may exceed 24 hours.
				/*int getTimer = TIME::GET_MILLISECONDS_PER_GAME_MINUTE();*/
		int getTimer = milliseconds;
		if (getTimer % droptimer2::timerbacktimes2 == 0)
		{
			/*for (int i = 0; i < 32; i++)
			{
				moneydrop::dropmoney(moneydrop::MoneyDrops2[i]);
			}*/
			moneydrop::dropmoney();
			droptimer2::getTickback = 1;
			droptimer2::getboolBack = 0;
			droptimer2::getbacktick = 1;
		}
	}
	if (!droptimer2::getbackbool2)
	{
		droptimer2::getTickback = 1;
		droptimer2::getboolBack = 1;
	}
}

bool droptimer2::getbacktick = true;
void droptimer2::timerback() {
	if (droptimer2::getbacktick)
	{
		DWORD ticks = GetTickCount64();
		DWORD milliseconds = ticks % 1000;
		int getmilli = milliseconds;
		if (getmilli % droptimer2::timerbacktimes2 == 0)
		{
			droptimer2::getbacktick = 0;
			droptimer2::getboolBack = 1;
		}
	}
}

