bool Features::aimbottoggle2 = false;
void Features::aimbot2(bool toggle)
{	
				const int ElementAmount = 10;
				const int ArrSize = ElementAmount * 2 + 2;
				Ped* peds = new Ped[ArrSize];
				peds[0] = ElementAmount;
				int PedFound = PED::GET_PED_NEARBY_PEDS(PLAYER::PLAYER_PED_ID(), peds, -1);
				for (int i = 0; i < PedFound; i++)
				{
					int OffsetID = i * 2 + 2;
					RequestControlOfEnt(peds[OffsetID]);
					if (peds[OffsetID] != PED::GET_PED_NEARBY_PEDS(PLAYER::PLAYER_PED_ID(), peds, -1))
					{
						/*int pedsoffsetid;*/
						Player playerPed = PLAYER::PLAYER_PED_ID();
						if (aimbottoggle2)
						{
							for (int i = 0; i < 32; i++)
							{
								/*Player playerHandle = PLAYER::GET_PLAYER_PED_SCRIPT_INDEX(i);*/
								char* Name = PLAYER::GET_PLAYER_NAME(PLAYER::INT_TO_PLAYERINDEX(i));
								if (ENTITY::DOES_ENTITY_EXIST(peds[OffsetID]))
								{
									if (peds[OffsetID] == playerPed) continue;
									{
										if (ENTITY::DOES_ENTITY_EXIST(PLAYER::PLAYER_PED_ID())
											&& ENTITY::HAS_ENTITY_CLEAR_LOS_TO_ENTITY(playerPed, peds[OffsetID], 17)
											&& !PED::IS_PED_RUNNING_RAGDOLL_TASK(peds[OffsetID])
											&& ENTITY::GET_ENTITY_ALPHA(peds[OffsetID]) == 255)
										{
											if (GetAsyncKeyState(0x01))
											{
												shootAtPed(peds[OffsetID]);
											}
										}
									}
								}
							}
						}
					}
				}			
}

