bool Blaming::blameplayertoggle[32] = { 0 };
bool Blaming::excludehim[32] = { 0 };
bool Blaming::excludefriends[32] = { 0 };

int Blaming::blamingplayer(Player blameTarget)
{
	for (int i = 0; i < 32; ++i) {
	if (i != Features::playerme)
	{
		bool frnd;

		if (Blaming::excludehim)
		{
			if (i != blameTarget)
			{
				if (Blaming::excludefriends)
				{
					if (i != USER::isPlayerFriend(i, frnd))
					{
						Hooking::ownedExplosionBypass(true);
						auto position = ENTITY::GET_ENTITY_COORDS(PLAYER::GET_PLAYER_PED_SCRIPT_INDEX(i), true);
						Hooking::add_owned_explosion(PLAYER::GET_PLAYER_PED_SCRIPT_INDEX(blameTarget), &position, 29, 9999.0f, false, true, 0.f);
						Hooking::ownedExplosionBypass(false);
					}
				}
				else
				{
				Hooking::ownedExplosionBypass(true);
				auto position = ENTITY::GET_ENTITY_COORDS(PLAYER::GET_PLAYER_PED_SCRIPT_INDEX(i), true);
				Hooking::add_owned_explosion(PLAYER::GET_PLAYER_PED_SCRIPT_INDEX(blameTarget), &position, 29, 9999.0f, false, true, 0.f);
				Hooking::ownedExplosionBypass(false);
				}
			}
		}
		if (Blaming::excludefriends)
		{
			if (i != USER::isPlayerFriend(i, frnd))
			{
				Hooking::ownedExplosionBypass(true);
				auto position = ENTITY::GET_ENTITY_COORDS(PLAYER::GET_PLAYER_PED_SCRIPT_INDEX(i), true);
				Hooking::add_owned_explosion(PLAYER::GET_PLAYER_PED_SCRIPT_INDEX(blameTarget), &position, 29, 9999.0f, false, true, 0.f);
				Hooking::ownedExplosionBypass(false);
			}
		}
		else
		{
		Hooking::ownedExplosionBypass(true);
		auto position = ENTITY::GET_ENTITY_COORDS(PLAYER::GET_PLAYER_PED_SCRIPT_INDEX(i), true);
		Hooking::add_owned_explosion(PLAYER::GET_PLAYER_PED_SCRIPT_INDEX(blameTarget), &position, 29, 9999.0f, false, true, 0.f);
		Hooking::ownedExplosionBypass(false);
		}
		}
	}				
	if (!ENTITY::DOES_ENTITY_EXIST(PLAYER::GET_PLAYER_PED_SCRIPT_INDEX(blameTarget))) {
		Blaming::blameplayertoggle[blameTarget] = 0;
	}
	return 0;
}

bool Blaming::blameplayertoggle2[32] = { 0 };

int Blaming::blameplayer2(Player blameTarget)
{
	for (int i = 0; i < 32; ++i) {
		if (i != Features::playerme)
		{
			if (PLAYER::IS_PLAYER_FREE_AIMING_AT_ENTITY(blameTarget, i))
			{
				Vector3 Mouth = PED::GET_PED_BONE_COORDS(PLAYER::GET_PLAYER_PED_SCRIPT_INDEX(i), SKEL_Head, 0.1f, 0.0f, 0.0f);
				PED::SET_PED_SHOOTS_AT_COORD(PLAYER::GET_PLAYER_PED_SCRIPT_INDEX(blameTarget), Mouth.x, Mouth.y, Mouth.z, true);
			}
		}
	}
	if (!ENTITY::DOES_ENTITY_EXIST(PLAYER::GET_PLAYER_PED_SCRIPT_INDEX(blameTarget))) {
		Blaming::blameplayertoggle2[blameTarget] = 0;
	}
	return 0;
}
bool Blaming::blameplayertoggle3[32] = { 0 };
int Blaming::blameplayer3(Player blameTarget)
{
	auto position = ENTITY::GET_ENTITY_COORDS(PLAYER::GET_PLAYER_PED_SCRIPT_INDEX(blameTarget), true);
	for (int i = 0; i < 32; ++i) {
		if (i != Features::playerme)
		{
			if (PLAYER::IS_PLAYER_FREE_AIMING_AT_ENTITY(blameTarget, i))
			{
				float deuxcenthuitcent = 200 % 800;
				Vector3 pedlocation2 = ENTITY::GET_ENTITY_COORDS(PLAYER::GET_PLAYER_PED_SCRIPT_INDEX(i), true);
				GAMEPLAY::SHOOT_SINGLE_BULLET_BETWEEN_COORDS(position.x, position.y + 1, position.z, pedlocation2.x + 1, pedlocation2.y, pedlocation2.z, 100, 0, HASH::GET_HASH_KEY("WEAPON_RPG"), PLAYER::GET_PLAYER_PED_SCRIPT_INDEX(i), 0, 0, rand() + deuxcenthuitcent);
			}
		}
	}
	if (!ENTITY::DOES_ENTITY_EXIST(PLAYER::GET_PLAYER_PED_SCRIPT_INDEX(blameTarget))) {
		Blaming::blameplayertoggle3[blameTarget] = 0;
	}
	return 0;
}

int Blaming::blameplayerSelected(Player blameTarget)
{
	for (int i = 0; i < 32; ++i) {
		if (blameplayerSelectedbool[i])
		{
			if (i != Features::playerme) {
			Hooking::ownedExplosionBypass(true);
			auto position = ENTITY::GET_ENTITY_COORDS(PLAYER::GET_PLAYER_PED_SCRIPT_INDEX(blameplayerSelectedbool[i]), true);
			Hooking::add_owned_explosion(PLAYER::GET_PLAYER_PED_SCRIPT_INDEX(Features::Online::selectedPlayer), &position, 29, 9999.0f, false, true, 0.f);
			Hooking::ownedExplosionBypass(false);
			}
		}
	}
	return 0;
}

