bool Missile::dronebool = 0;
int Missile::drone()
{

	int flags = *ScriptGlobal::ScriptGlobal(DroneGlobal[0]).As<int*>();
	flags = misc::set_bit(flags, 2);
	flags = misc::set_bit(flags, 22);
	flags = misc::set_bit(flags, 23);
	flags = misc::set_bit(flags, 24);
	*ScriptGlobal::ScriptGlobal(DroneGlobal[0]).As<int*>() = flags;
	/*g_CallbackScript->AddCallback<DelayCallback>(100ms, []
		{*/
	DWORD ticks = GetTickCount64();
	DWORD milliseconds = ticks % 1000;
	ticks /= 1000;
	DWORD seconds = ticks % 60;
	int getTimer = seconds;
	if (getTimer % 9 == 0)
	{
		int flags = *ScriptGlobal::ScriptGlobal(DroneGlobal[0]).As<int*>();
		flags = misc::clear_bit2(flags, 2);
		flags = misc::clear_bit2(flags, 22);
		flags = misc::clear_bit2(flags, 23);
		*ScriptGlobal::ScriptGlobal(DroneGlobal[0]).As<int*>() = flags;
	}
		/*});*/
	return 0;
}

