float LargeurVH = 0.0f;
float LongueurVH = 0.0f;
float HauteurVH = 0.0f;

float LargeurPH = 0.0f;
float LongueurPH = 0.0f;
float HauteurPH = 0.0f;

void UpdatePlayerOffsets(Player player)
{
	if (!ENTITY::DOES_ENTITY_EXIST(player))
		return;
	Player me = PLAYER::PLAYER_PED_ID();
	if (!PED::IS_PED_IN_ANY_VEHICLE(me, 0))
	{
		Vector3 minDim, maxDim;
		Hash model = ENTITY::GET_ENTITY_MODEL(player);
		GAMEPLAY::GET_MODEL_DIMENSIONS(model, &minDim, &maxDim);

		float largeur = maxDim.x - minDim.x; // largeur totale du vhicule
		float longueur = maxDim.y - minDim.y; // longueur
		float hauteur = maxDim.z - minDim.z; // hauteur
		LargeurPH = largeur;
		LongueurPH = longueur;
		HauteurPH = hauteur;

		// minDim.z est gnralement ngatif, on veut la distance du centre  la base
		float baseZ = -minDim.z; // plus clair que fabs ici

		// Normal : hauteur du sol relative au point d'ancrage + un petit offset
		Features::Normal = baseZ - 0.22f;
		Features::Up = Features::Normal - (Features::Normal + 0.5f); // rsultat : -0.5
		Features::Down = Features::Normal + (hauteur * 0.2f);

		//int boneIndex = ENTITY::GET_ENTITY_BONE_INDEX_BY_NAME(veh, "wheel_lf");

		Ped playerPed = PLAYER::PLAYER_PED_ID();
		//int rightFootBone = ENTITY::GET_ENTITY_BONE_INDEX_BY_NAME(playerPed, "SKEL_R_Foot");
		int leftFootBone = ENTITY::GET_ENTITY_BONE_INDEX_BY_NAME(playerPed, "SKEL_L_Foot");
		Vector3 footPos = ENTITY::GET_WORLD_POSITION_OF_ENTITY_BONE(playerPed, leftFootBone);
		Vector3 endPos = { footPos.x, footPos.y, footPos.z - 5.0f };

		int rayDrive = 0;
		BOOL hitDrive;
		Vector3 hitCoordsDrive, surfaceNormalDrive;
		Entity entityHitDrive;

		rayDrive = WORLDPROBE::_START_SHAPE_TEST_RAY(
			footPos.x, footPos.y, footPos.z,
			endPos.x, endPos.y, endPos.z,
			-1, playerPed, 7
		);
		WORLDPROBE::GET_SHAPE_TEST_RESULT(rayDrive, &hitDrive, &hitCoordsDrive, &surfaceNormalDrive, &entityHitDrive);
	}
	
}

