Object Create_Obj1(char* ObjectName, Vector3 Coordinates)
{
	Object returnObja;
	Hash ObjectHash = HASH::GET_HASH_KEY(ObjectName);
	if (STREAMING::IS_MODEL_IN_CDIMAGE(ObjectHash))
	{
		if (STREAMING::IS_MODEL_VALID(ObjectHash))
		{
			STREAMING::REQUEST_MODEL(ObjectHash/*, 0*/);
			if (STREAMING::HAS_MODEL_LOADED(ObjectHash))
			{
				returnObja = OBJECT::CREATE_OBJECT_NO_OFFSET(ObjectHash, Coordinates.x - Features::objectx, Coordinates.y - Features::objecty, Coordinates.z - Features::objectz, 1, 1, 0);
				

				if (Features::walkinairvisible)
				{
					ENTITY::SET_ENTITY_VISIBLE2(returnObja, 1);
					/*ENTITY::SET_ENTITY_VISIBLE(returnObja, 1, 1);*/
					ENTITY::SET_ENTITY_ALPHA(returnObja, 255, 1);
					NETWORK::NETWORK_REGISTER_ENTITY_AS_NETWORKED(returnObja);
					NETWORK::_NETWORK_SET_ENTITY_INVISIBLE_TO_NETWORK(returnObja, false);
					DWORD id = NETWORK::OBJ_TO_NET(returnObja);
					if (NETWORK::NETWORK_DOES_NETWORK_ID_EXIST(id)) {
						ENTITY::_SET_ENTITY_NOT_HAVE_ADVANCED_PHYSICS(returnObja, true);
						if (NETWORK::NETWORK_GET_ENTITY_IS_NETWORKED(returnObja)) {
							NETWORK::SET_NETWORK_ID_EXISTS_ON_ALL_MACHINES(id, true);
							NETWORK::_NETWORK_CAN_NETWORK_ID_BE_SEEN(id);
						}
					}
				}
				else
				{
					ENTITY::SET_ENTITY_VISIBLE2(returnObja, 0);
					/*ENTITY::SET_ENTITY_VISIBLE(returnObja, 0, 0);*/
					ENTITY::SET_ENTITY_ALPHA(returnObja, 0, 0);
					NETWORK::NETWORK_REGISTER_ENTITY_AS_NETWORKED(returnObja);
					NETWORK::_NETWORK_SET_ENTITY_INVISIBLE_TO_NETWORK(returnObja, true);
					DWORD id = NETWORK::OBJ_TO_NET(returnObja);
					if (NETWORK::NETWORK_DOES_NETWORK_ID_EXIST(id)) {
						ENTITY::_SET_ENTITY_NOT_HAVE_ADVANCED_PHYSICS(returnObja, true);
						if (NETWORK::NETWORK_GET_ENTITY_IS_NETWORKED(returnObja)) {
							NETWORK::SET_NETWORK_ID_EXISTS_ON_ALL_MACHINES(id, true);
							NETWORK::_NETWORK_CAN_NETWORK_ID_BE_SEEN(id);
						}
					}
				}
			}
			else
			{
				returnObja = NULL;
			}
		}
	}
	return ObjectHash;
}

Vector3 Features::CombineVector(float x, float y, float z)
{
	Vector3 returnVector;
	returnVector.x = x;
	returnVector.y = y;
	returnVector.z = z;
	return returnVector;
}
bool stopnotifycar = 1;
bool stoptimer = 1;
int getnotify()
{
	DWORD ticks = GetTickCount64();
	DWORD milliseconds = ticks % 1000;
	ticks /= 1000;
	DWORD seconds = ticks % 60;
	int getTimer = seconds;
	if (getTimer % 15 == 0)
	{
		stopnotifycar = 0;
		stoptimer = 0;
	}
	return 0;
}
bool Features::featureWalk1 = false;
int Features::featureWalkk1(bool toggle)
{
	if (featureWalk1)
	{
		char* prop = (char*)Features::walkinairdword;
		if (firstwalk || ifwalkorincar)
		{
			checkifwalk(prop);
			firstwalk = 0;
		}
		if (!Features::incars)
		{
		if (!opened_before2)
		{
			if (stoptimer)
			{
				getnotify();
			if (stopnotifycar)
				notifyMap("F4 or R3 activate walk in sky and in a car \n press q for up, and z for down \n");
			}
			if (helpers::get_key_state(VK_KEY_Z, 1) || helpers::get_key_state(VK_KEY_Q, 1))
			{
				opened_before2 = true;
			}
		}
		bool opencontroller = (CONTROLS::IS_DISABLED_CONTROL_JUST_PRESSED(2, open22) & 1);
		bool openf3 = (GetAsyncKeyState(VK_F4) & 1);
		if (openf3 || opencontroller)
		{
			walkinsky = !walkinsky;
		}
		if (walkinsky)
		{
			Hash ObjHash = HASH::GET_HASH_KEY(prop);
			Player me = PLAYER::PLAYER_PED_ID();
			Vector3 PlayerCoord;
				PlayerCoord = ENTITY::GET_ENTITY_COORDS(me, 0/*, 0*/);
			float zPlane;
			Object WalkOnAir = OBJECT::GET_CLOSEST_OBJECT_OF_TYPE(PlayerCoord.x, PlayerCoord.y, PlayerCoord.z, 100, ObjHash, 1, 0, 1);
			if (!ENTITY::DOES_ENTITY_EXIST(WalkOnAir) && (featureWalk1))
			{
				DWORD ticks = GetTickCount64();
				DWORD milliseconds = ticks % 1000;
				int getTimer = milliseconds;
				if (getTimer % 250 == 0)
				{
					Object WalkOnAir2 = Create_Obj1(prop, PlayerCoord);
					ENTITY::FREEZE_ENTITY_POSITION(WalkOnAir, 1);
				}
			}
			else if (ENTITY::DOES_ENTITY_EXIST(WalkOnAir) && (featureWalk1))
			{
				if (PED::IS_PED_IN_ANY_VEHICLE(me, 0))
				{
					zPlane = PlayerCoord.z - Features::Vehicular;
				}
				else
					if (GetAsyncKeyState(0x5A) || (CONTROLS::IS_DISABLED_CONTROL_PRESSED(2, INPUT_SCRIPT_LS)))      //Down Z and L3          
					{
						zPlane = PlayerCoord.z - Features::Down;
					}
					else if (GetAsyncKeyState(0x51) || (CONTROLS::IS_DISABLED_CONTROL_PRESSED(2, INPUT_SCRIPT_RS)))      //Up Q and R3  
					{
						zPlane = PlayerCoord.z + Features::Up;
					}
					else                                              //Normal
					{
						zPlane = PlayerCoord.z - Features::Normal;
					}
				Vector3 pRot = ENTITY::GET_ENTITY_ROTATION(me, 0);
				ENTITY::SET_ENTITY_ROTATION(WalkOnAir, 0, 0, pRot.z, 0, 1);
				Vector3 Coord = CombineVector(PlayerCoord.x, PlayerCoord.y, zPlane);
				ENTITY::SET_ENTITY_ROTATION(WalkOnAir, Features::objectpitch, Features::objectroll, Features::objectyaw, Features::rotationOrder, 1);
				/*ENTITY::SET_ENTITY_COORDS_NO_OFFSET(WalkOnAir, Coord.x - Features::objectx, Coord.y - Features::objecty, Coord.z - Features::objectz, 1, 0, 1);*/
				ENTITY::/*SET_ENTITY_COORDS_NO_OFFSET*/_SET_ENTITY_COORDS_2(WalkOnAir, Coord.x - Features::objectx, Coord.y - Features::objecty, Coord.z - Features::objectz, 0, 0, 0, 0);
			}
		}
		}
		else if (Features::incars)
		{
			Features::dowboolair = true;
		}
	}
	return 0;
}


