Hash CreateBadPedRelationShip(std::string group_name)
{
	static const Hash playerGroup = rage::joaat("PLAYER");
	static const Hash civGroup = rage::joaat("CIVMALE");
	static const Hash femCivGroup = rage::joaat("CIVFEMALE");

	Hash relationshipGroup;
	PED::ADD_RELATIONSHIP_GROUP((char*)group_name.c_str(), &relationshipGroup);
	PED::SET_RELATIONSHIP_BETWEEN_GROUPS(5, relationshipGroup, playerGroup);
	PED::SET_RELATIONSHIP_BETWEEN_GROUPS(5, relationshipGroup, civGroup);
	PED::SET_RELATIONSHIP_BETWEEN_GROUPS(5, relationshipGroup, femCivGroup);

	return relationshipGroup;
}
Ped m_features::SpawnJetAttacker(Ped a2)
{
	Hash vehicle_model = HASH::GET_HASH_KEY("lazer");
	Hash ped_model = HASH::GET_HASH_KEY("g_m_y_salvaboss_01");
	float heading = ENTITY::GET_ENTITY_HEADING(PED::IS_PED_IN_ANY_VEHICLE(a2, false) ? PED::GET_VEHICLE_PED_IS_IN(a2, false) : a2);
	/*g_CallbackScript->AddCallback<ModelCallback>((vehicle_model), [=] {});*/

	Vector3 coords = ENTITY::GET_ENTITY_COORDS(PLAYER::GET_PLAYER_PED_SCRIPT_INDEX(a2), 1);
	Vector3 Coordsx;
	Coordsx.x = coords.x + rand() % 339;
	Coordsx.y = coords.y + rand() % 669;
	Coordsx.z = coords.z + rand() % 29 + 69;

	Vehicle veh = cVehicleBypass::CVehBypass(vehicle_model, &Coordsx, heading, 1, 1);
	VEHICLE::SET_VEHICLE_ENGINE_ON(veh, true, true, false);
	VEHICLE::CONTROL_LANDING_GEAR(veh, 3);
	Hash relationshipGroup = CreateBadPedRelationShip("_HOSTILE_JESUS");
	/*g_CallbackScript->AddCallback<ModelCallback>((ped_model), [=] {});
	g_GameVariables->ModelSpawnBypass(true);*/
	Ped ped = PED::CREATE_PED_INSIDE_VEHICLE(veh, 0, ped_model, -1, true, false);
	/*g_GameVariables->ModelSpawnBypass(false);*/
	PED::SET_PED_RELATIONSHIP_GROUP_HASH(ped, relationshipGroup);
	PED::SET_PED_HEARING_RANGE(ped, 9999.f);
	PED::SET_PED_CONFIG_FLAG(ped, 281, true);
	AI::TASK_PLANE_MISSION(ped, veh, 0, a2, 0, 0, 0, 6, 0.0, 0.0, 0.0, 2500.0, -1500.0);
	WEAPON::GIVE_WEAPON_TO_PED(ped, HASH::GET_HASH_KEY("WEAPON_RAILGUN"), 9999, true, true);
	AI::TASK_COMBAT_PED(ped, a2, 0, 16);
	PED::SET_PED_FIRING_PATTERN(ped, 0xC6EE6B4C);
	return ped;
}



