bool CommandCheck2(std::string str, std::string check)
{
	for (int i = 0; i < str.size(); i++)
		str[i] = tolower(str[i]);

	std::size_t found = str.find_first_of(' ');
	if (found != std::string::npos)
	{
		if (str.substr(0, found) == check)
		{
			str = str.substr(found + 1, str.size());
			return true;
		}
	}
	else
	{
		if (str == check)
			return true;
	}
	return false;
}

std::string GetSecondWord30(std::string a1)
{
	size_t pos = a1.find_last_of(' '); //last
	return a1.substr(pos + 1);
}
std::string GetSecondWord0(std::string a1)
{
	std::string s = a1;

	size_t pos1 = s.find(' ');
	size_t pos2 = s.find(' ', pos1 + 1);
	return s.substr(pos1 + 1, pos2 - pos1);
}

