int Features::ballistic_armor_value = 0;
void Features::ballistic_armor()
{
	/*globalHandle(262145).At(19995).As<int>() = ballistic_armor_value;*/
	/**script_global(262145).at(28073).as<int*>()
		* script_global(262145).at(28074).as<int*>()
		ballistic armor global :*/

	const size_t arraySize = sizeof(BallisticArmorGlobal) / sizeof(BallisticArmorGlobal[0]);
	int intValues[arraySize]; // Tableau d'entiers int
	for (size_t i = 0; i < arraySize; ++i) {
		intValues[i] = BallisticArmorGlobal[i];
	}
	const size_t arraySize2 = sizeof(FreeBallisticArmorGlobal) / sizeof(FreeBallisticArmorGlobal[0]);
	int intValues2[arraySize2]; // Tableau d'entiers int
	for (size_t i = 0; i < arraySize2; ++i) {
		intValues2[i] = FreeBallisticArmorGlobal[i];
	}
	globalHandle(intValues).As<int>() = ballistic_armor_value;
	globalHandle(intValues2).As<int>() = ballistic_armor_value;
}


