void m_business::BusinessTick()
{
	if (m_business::BunkerSupply() != -1 && m_business::BunkerSupply() < supplyBusiness::m_BusinessSupplyMin)
	{
		AddBunkerSupply();
		//Features::notify_custom(140, (char*)"Business Manager", (char*)"Supply added to your bunker.");
	}
	if (m_business::CashSupply() != -1 && m_business::CashSupply() < supplyBusiness::m_BusinessSupplyMin)
	{
		m_business::AddCashSupply();
		//Features::notify_custom(140, (char*)"Business Manager", (char*)"Supply added to your cash hub.");
	}
	if (m_business::WeedSupply() != -1 && m_business::WeedSupply() < supplyBusiness::m_BusinessSupplyMin)
	{
		m_business::AddWeedSupply();
		//Features::notify_custom(140, (char*)"Business Manager", (char*)"Supply added to your weed hub.");
	}
	if (m_business::MethSupply() != -1 && m_business::MethSupply() < supplyBusiness::m_BusinessSupplyMin)
	{
		m_business::AddMethSupply();
		//Features::notify_custom(140, (char*)"Business Manager", (char*)"Supply added to your meth hub.");
	}
	if (m_business::CocaineSupply() != -1 && m_business::CocaineSupply() < supplyBusiness::m_BusinessSupplyMin)
	{
		m_business::AddCocaineSupply();
		//Features::notify_custom(140, (char*)"Business Manager", (char*)"Supply added to your cocaine hub.");
	}
	if (m_business::DocumentsSupply() != -1 && m_business::DocumentsSupply() < supplyBusiness::m_BusinessSupplyMin)
	{
		m_business::AddDocumentsSupply();
		//Features::notify_custom(140, (char*)"Business Manager", (char*)"Supply added to your documents hub.");
	}

}








































