{
	if (auto bunker_selling = find_networked(RAGE_JOAAT("gb_gunrunning")))//Bunker
	{
		*ScriptLocal::ScriptLocal(bunker_selling, 1203).Add(774).As<int*>() = 0;
	}

	if (auto mc_selling = find_networked(RAGE_JOAAT("gb_biker_contraband_sell")))//MC Business
	{
		int requirement = *ScriptLocal::ScriptLocal(mc_selling, 696).Add(143).As<int*>();
		*ScriptLocal::ScriptLocal(mc_selling, 696).Add(122).As<int*>() = requirement;
	}
}

