bool Features::maxallcarnearbool = 0;
int Features::maxallcarnear()
{
	PLAYER::_EXPAND_WORLD_LIMITS(FLT_MAX, FLT_MAX, FLT_MAX);
	const int ElementAmount = 10;
	const int ArrSize = ElementAmount * 2 + 2;
	Vehicle* vehs = new Vehicle[ArrSize];
	vehs[0] = ElementAmount;
	int VehFound = PED::GET_PED_NEARBY_VEHICLES(PLAYER::PLAYER_PED_ID(), vehs);
	for (int i = 0; i < VehFound; i++)
	{
		int OffsetID = i * 2 + 2;
		int car = vehs[OffsetID];
		if (car != PED::GET_VEHICLE_PED_IS_IN(PLAYER::PLAYER_PED_ID(), false))
		{
			if (VEHICLE::IS_THIS_MODEL_A_CAR(ENTITY::GET_ENTITY_MODEL(car)))
			{
			RequestControlOfEnt(car);
			if (Features::CustomCar == true) {
				VEHICLE::_IS_VEHICLE_NEON_LIGHT_ENABLED(car, 1);
				VEHICLE::_SET_VEHICLE_NEON_LIGHT_ENABLED(car, 0, 1);
				VEHICLE::_SET_VEHICLE_NEON_LIGHT_ENABLED(car, 1, 1);
				VEHICLE::_SET_VEHICLE_NEON_LIGHT_ENABLED(car, 2, 1);
				VEHICLE::_SET_VEHICLE_NEON_LIGHT_ENABLED(car, 3, 1);
				VEHICLE::_SET_VEHICLE_NEON_LIGHT_ENABLED(car, 4, 1);
				VEHICLE::_SET_VEHICLE_NEON_LIGHT_ENABLED(car, 5, 1);
				VEHICLE::_SET_VEHICLE_NEON_LIGHT_ENABLED(car, 6, 1);
				VEHICLE::_SET_VEHICLE_NEON_LIGHT_ENABLED(car, 7, 1);
				VEHICLE::SET_VEHICLE_MOD_KIT(car, 0);
				VEHICLE::SET_VEHICLE_WHEEL_TYPE(car, Features::bennystypeok);
				VEHICLE::SET_VEHICLE_MOD(car, 23, Features::bennysok, 0);
				VEHICLE::SET_VEHICLE_CUSTOM_PRIMARY_COLOUR(car, Features::paintcolor01, Features::paintcolor02, Features::paintcolor03);
				VEHICLE::SET_VEHICLE_COLOURS(car, Features::chrome, Features::chrome);
				VEHICLE::SET_VEHICLE_MOD(car, 14, Features::hornsound, 0);
			}
			VEHICLE::SET_VEHICLE_MOD_KIT(car, 0);
			for (int i = 0; i < 50; i++)
			{
				VEHICLE::SET_VEHICLE_MOD(car, i, VEHICLE::GET_NUM_VEHICLE_MODS(car, i) - Features::modkit, false);
			}
			VEHICLE::SET_VEHICLE_NUMBER_PLATE_TEXT(car, "Thunder");
			if (VEHICLE::IS_VEHICLE_STOLEN(car))
			{
				VEHICLE::SET_VEHICLE_IS_STOLEN(car, false);
				Log::Msg("Stolen False");
			}
		}
		}
	}
	return 0;
}

