Vector3 operator+(const Vector3& v1, const Vector3& v2)
{
	Vector3 result;
	result.x = v1.x + v2.x;
	result.y = v1.y + v2.y;
	result.z = v1.z + v2.z;
	return result;
}

Vector3 operator*(const Vector3& v, const float f)
{
	Vector3 result = { v.x * f, 0, v.y * f, 0, v.z * f, 0 };
	return result;
}

Vector3 operator-(const Vector3& v, const float f)
{
	Vector3 result = { v.x - f, v.y - f, v.z - f };
	return result;
}
Vector3 operator-(const Vector3& v1, const Vector3& v2)
{
	Vector3 result;
	result.x = v1.x - v2.x;
	result.y = v1.y - v2.y;
	result.z = v1.z - v2.z;
	return result;
}
Vector3 operator/(const Vector3& v, const float scalar) {
	Vector3 result = { v.x / scalar, v.y / scalar, v.z / scalar };
	return result;
}

Vector3& operator/=(Vector3& v, const float scalar) {
	Vector3 result = { v.x /= scalar, v.y /= scalar, v.z /= scalar };
	return result;
}

Vector3 normalize(const Vector3& v) {
	float mag = sqrt(v.x * v.x + v.y * v.y + v.z * v.z);
	if (mag == 0) {
		return Vector3();
	}
	Vector3 result = { v.x / mag, v.y / mag, v.z / mag };
	return result;
}

