int Features::paticleupdown()
{
	if (turnupdownparticle)
	{
		if (Features::particleheight == Features::particleheightmax)
		{
			turnupdownparticle = false;
		}
		else
			if (Features::particleheight < Features::particleheightmax)
			{

				Features::particleheight = Features::particleheight + 1;
				particle::auraZ = Features::particleheight;
			}
	}
	else
	{
		if (!turnupdownparticle)
		{
			if (Features::particleheight == Features::particleheightmin)
			{
				turnupdownparticle = true;
			}
			else
				if (Features::particleheight > Features::particleheightmin)
				{
					Features::particleheight = Features::particleheight - 1;
					particle::auraZ = Features::particleheight;
				}
		}
	}
	return 0;
}
