int Features::fireexplosionparticle2()
{
	if (particle::auraglimmer2) {
		Features::timerpaticle2();

		if (Features::turnupparticle2)
		{
			Features::paticleupdown2();
		}
		if (Features::turnrupparticle2)
		{
			Features::paticlerupdown2();
		}
	}
	float step = particle::auraincrement2;
	float x = particle::auraradius2 * sin(DEG2RAD(step));
	float y = particle::auraradius2 * cos(DEG2RAD(step));
	int playerselected = PLAYER::GET_PLAYER_PED_SCRIPT_INDEX(Features::Online::selectedPlayer);
	Vector3 pos = ENTITY::GET_ENTITY_COORDS(playerselected, true);
	Vector3 mposition;
	mposition.x = pos.x + x;
	mposition.y = pos.y + y;
	mposition.z = pos.z + particle::auraZ2;
	Hooking::ownedExplosionBypass(true);
	Hooking::add_owned_explosion(playerselected, &mposition, particle::auratype2, particle::auraexplosion2, particle::audible2, particle::visible2, particle::camerashake2);
	Hooking::ownedExplosionBypass(false);
	return 0;
}

int Features::fireexplosionparticle()
{
	if (particle::auraglimmer) {
		Features::timerpaticle();

		if (Features::turnupparticle)
		{
			Features::paticleupdown();
		}
		if (Features::turnrupparticle)
		{
			Features::paticlerupdown();
		}
	}
	float step = particle::auraincrement;
	float x = particle::auraradius * sin(DEG2RAD(step));
	float y = particle::auraradius * cos(DEG2RAD(step));
	int playerselected = PLAYER::GET_PLAYER_PED_SCRIPT_INDEX(Features::Online::selectedPlayer);
	Vector3 pos = ENTITY::GET_ENTITY_COORDS(playerselected, true);
	Vector3 mposition;
	mposition.x = pos.x + x;
	mposition.y = pos.y + y;
	mposition.z = pos.z + particle::auraZ;
	Hooking::ownedExplosionBypass(true);
	Hooking::add_owned_explosion(playerselected, &mposition, particle::auratype, particle::auraexplosion, particle::audible, particle::visible, particle::camerashake);
	Hooking::ownedExplosionBypass(false);
	return 0;
}





