bool m_function::raincolor = 0;
int m_function::rain()
{
	if (g_Settings.m_RainModification)
	{
		g_Settings.m_RainIntensity = Features::RAINFXINTENSITY;
		*(float*)g_GameVariable2->m_RainRed = (g_Settings.m_RainRed / 255.f) * g_Settings.m_RainIntensity;
		*(float*)g_GameVariable2->m_RainGreen = (g_Settings.m_RainGreen / 255.f) * g_Settings.m_RainIntensity;
		*(float*)g_GameVariable2->m_RainBlue = (g_Settings.m_RainBlue / 255.f) * g_Settings.m_RainIntensity;
	}
	return 0;
}
