bool firstcanon = 1;

bool m_features::orbitalrefundtwominbool = 0;
void m_features::orbitalrefundtwomin()
{
	if (firstcanon)
	{
		firstcanon = 0;
		*ScriptGlobal::ScriptGlobal(1968313).As<int*>() = 1;
	}


	DWORD ticks = GetTickCount64();
	DWORD milliseconds = ticks % 1000;
	ticks /= 1000;
	DWORD seconds = ticks % 60;
	//ticks /= 60;
	//DWORD minutes = ticks % 60;
	//ticks /= 60;
	//DWORD hours = ticks; // may exceed 24 hours.
	int getTimer = seconds;
	if (getTimer % 120 == 0)
	{
		*ScriptGlobal::ScriptGlobal(1968313).As<int*>() = 1;
	}
	if (!m_features::orbitalrefundtwominbool)
		firstcanon = 1;
}

Vector3 TPCoords2;
void TPto2(Vector3 Coords)
{
	int Handle = PLAYER::PLAYER_PED_ID();
	if (PED::IS_PED_IN_ANY_VEHICLE(Handle, 0))
	{
		/*ENTITY::SET_ENTITY_COORDS(PED::GET_VEHICLE_PED_IS_IN(Handle, false), Coords.x, Coords.y, Coords.z, 0, 0, 0, 1);*/
		ENTITY::SET_ENTITY_COORDS_NO_OFFSET(PED::GET_VEHICLE_PED_IS_IN(Handle, false), Coords.x, Coords.y, Coords.z, 0, 0, 1);
	}
	else
		/*ENTITY::SET_ENTITY_COORDS(Handle, Coords.x, Coords.y, Coords.z, 0, 0, 0, 1);*/
		ENTITY::SET_ENTITY_COORDS_NO_OFFSET(Handle, Coords.x, Coords.y, Coords.z, 0, 0, 1);
}

bool HostCrash::HostCrashbool = 1;
bool HostCrash::boolHostCrash = 0;
void HostCrash::HostCrash()
{
	if (HostCrash::HostCrashbool)
	{
		int Me = PLAYER::PLAYER_PED_ID();
		TPCoords2 = ENTITY::GET_OFFSET_FROM_ENTITY_IN_WORLD_COORDS(Me, 0.0, 0.0, 0.0);
		HostCrash::HostCrashbool = 0;
	}
	Vector3 Coords;
	Coords.x = 10841.274f; Coords.y = -6928.6284; Coords.z = 1.0732422;
	TPto2(Coords);
	DWORD ticks = GetTickCount64();
	DWORD milliseconds = ticks % 1000;
	ticks /= 1000;
	DWORD seconds = ticks % 60;
	//ticks /= 60;
	//DWORD minutes = ticks % 60;
	//ticks /= 60;
	//DWORD hours = ticks; // may exceed 24 hours.
	int getTimer = seconds;
	if (getTimer % 5 == 0)
	{
		TPto2(TPCoords2);
		HostCrash::HostCrashbool = 1;
		HostCrash::boolHostCrash = 0;
	}
}
