void delete_entity(Entity ent)
{
	ENTITY::DETACH_ENTITY(ent, 1, 1);
	ENTITY::SET_ENTITY_VISIBLE(ent, false, false);
	NETWORK::NETWORK_SET_ENTITY_ONLY_EXISTS_FOR_PARTICIPANTS(ent, true);
	ENTITY::SET_ENTITY_COORDS_NO_OFFSET(ent, 0, 0, 0, 0, 0, 0);
	ENTITY::SET_ENTITY_AS_MISSION_ENTITY(ent, 1, 1);
	ENTITY::DELETE_ENTITY(&ent);
}
//using request_control = void(*)(rage::netObject* net_object);
using request_control = void(rage::netObject* net_object);
request_control* m_request_control;

bool network_has_control_of_entity(rage::netObject* net_object)
{
	return !net_object || !net_object->m_is_remote && (net_object->m_wants_to_be_owner == -1);
}

bool take_control_of(Entity ent, int timeout)
{
	Log::Msg("entity 1");
	if (!*g_GameVariables->m_IsSessionStarted)
		return true;
	Log::Msg("entity 2");
	auto hnd = g_GameVariables->m_HandleToPtr(ent);

	if (!hnd || !hnd->m_net_object)
		return false;
	Log::Msg("entity 3");
	if (hnd->m_entity_type != 3 && hnd->m_entity_type != 4 && hnd->m_entity_type != 5)
		return false;
	Log::Msg("entity 4");
	for (int i = 0; i <= timeout; ++i)
	{
		m_request_control(hnd->m_net_object);

		if (network_has_control_of_entity(hnd->m_net_object))
			return true;
		Log::Msg("entity 5");
		if (timeout != 0)
			script::get_current()->yield();
	}
	Log::Msg("entity 6");
	return false;
}

