void m_features::teleportalltome()
{
	int Me = PLAYER::PLAYER_PED_ID();
	Vector3 MyPosition = ENTITY::GET_OFFSET_FROM_ENTITY_IN_WORLD_COORDS(Me, 0.0, 0.0, 0.0);

	for (int i = 0; i <= 32; i++)
	{
		try {
			DWORD ticks = GetTickCount64();
			DWORD milliseconds = ticks % 1000;
			ticks /= 1000;
			DWORD seconds = ticks % 60;
			int getTimer = seconds;
			if (getTimer % 1 == 0)
			{
				int Handle = PLAYER::GET_PLAYER_PED_SCRIPT_INDEX(i);
				if (Handle != Features::playerme)
				{
					m_features::TeleportPlayerToCoords(Handle, MyPosition);
					notifyMap("Teleport All To Me");
				}
				UI::_SET_NOTIFICATION_TEXT_ENTRY("STRING");
				UI::ADD_TEXT_COMPONENT_SUBSTRING_PLAYER_NAME("~r~Teleport All To Me");
				UI::_SET_NOTIFICATION_MESSAGE_CLAN_TAG_2("CHAR_STRIPPER_CHEETAH", "CHAR_STRIPPER_CHEETAH", 1, 8, "~w~Thunder-Menu\n", "~w~Teleport All To Me\r\n", 1, "~w~Thunder Menu\n ~w~Teleport All To Me\r\n", 9, 1);
				UI::_DRAW_NOTIFICATION_3(FALSE, FALSE);
			}
		}
		catch (...) {
			return;
		}
		{
			if (i == 31)
			{
				break;
			}
		}
	}
}

