int CGameScriptHandlerNetComponent::get_participant_index(CNetGamePlayer* player)
{
	if (player == (*g_GameVariables->m_NetworkPlayerMgr)->m_local_net_player)
		return m_local_participant_index;

	if (m_num_participants <= 1)
		return -1;

	for (int i = 0; i < m_num_participants - 1; i++)
	{
		if (m_participants[i] && m_participants[i]->m_net_game_player == player)
			return m_participants[i]->m_participant_index;
	}

	return -1;
}


inline bool force_host(rage::joaat_t hash)
{
	if (auto launcher = gta_util::find_script_thread(hash); launcher && launcher->m_net_component)
	{
		for (int i = 0; !((CGameScriptHandlerNetComponent*)launcher->m_net_component)->is_local_player_host(); i++)
		{
			if (i > 200)
				return false;

			((CGameScriptHandlerNetComponent*)launcher->m_net_component)
				->send_host_migration_event(g_player_service->get_self()->get_net_game_player());
			script::get_current()->yield(10ms);

			if (!launcher->m_stack || !launcher->m_net_component)
				return false;
		}
	}

	return true;
}

bool CGameScriptHandlerNetComponent::is_player_a_participant(CNetGamePlayer* player)
{
	return m_participant_bitset & (1 << player->m_player_id);
}

inline void start_launcher_script(int script_id)
{
	static auto check_players_in_state = [](GtaThread* launcher, int state) -> bool {
		bool set = false;

		if (!launcher->m_net_component)
			return false;

		for (auto& [_, plyr] : g_player_service->players())
		{
			if (((CGameScriptHandlerNetComponent*)launcher->m_net_component)->is_player_a_participant(g_GameVariables->m_GetNetPlayer(Features::Online::selectedPlayer)))
			//if (((CGameScriptHandlerNetComponent*)launcher->m_net_component)->is_player_a_participant(plyr->get_net_game_player()))
			{
				if (*script_local::script_local(launcher->m_stack, 233).at(Features::Online::selectedPlayer, 3).at(2).as<int*>() == state)
				{
					set = true;
					break;
				}
			}
		}

		return set;
	};
	Log::Msg("logs7");
	// 1) Get launcher
	if (auto launcher = gta_util::find_script_thread(RAGE_JOAAT("am_launcher")))
	{
		// 2) Force host of launcher
		if (!force_host(RAGE_JOAAT("am_launcher")))
		{
			// 2F) Failed to force host of launcher
			//g_notification_service->push_error("Script", "Cannot force script host of am_launcher");
			return;
		}

		launcher->m_context.m_state = eThreadState::unk_3; // prevent bad things from happening to the thread in the meantime

		// 3) Remove players from that annoying waiting stage
		if (check_players_in_state(launcher, 5))
		{
			for (int i = 0; check_players_in_state(launcher, 5); i++)
			{
				if (i > 200)
					break; // 3F) Timeout

				*scr_globals::launcher_global.Add(3).Add(1).As<int*>() = 0;
				*scr_globals::launcher_global.Add(2).As<int*>() = 6;
				//script::get_current()->yield(10ms);
				WAIT(10);
			}
		} // State should now be 6 or 0

		// 4) Check if a script is already being executed, and unstuck from that state if so
		if (check_players_in_state(launcher, 6))
		{
			for (int i = 0; check_players_in_state(launcher, 6); i++)
			{
				if (i > 200)
					break; // 4F) Timeout

				*scr_globals::launcher_global.Add(3).Add(1).As<int*>() = 0;
				*scr_globals::launcher_global.Add(2).As<int*>() = 7;
				//script::get_current()->yield(10ms);
				WAIT(10);
			}
		} // State should now be 7 or 0

		// 5) Get everyone out of state 7
		if (check_players_in_state(launcher, 7))
		{
			for (int i = 0; check_players_in_state(launcher, 7); i++)
			{
				if (i > 200)
					break; // 5F) Timeout

				*scr_globals::launcher_global.Add(2).As<int*>() = 0;
				//script::get_current()->yield(10ms);
				WAIT(10);
			}
		} // State should now be 0

		// 6) Actually get the script to start



		// Utilisation de reinterpret_cast pour convertir int* en int
		int convertedNumber = reinterpret_cast<int>(scr_globals::launcher_global.Add(1).As<int*>());

		misc::set_bit(convertedNumber, 1); // run immediately
		*scr_globals::launcher_global.Add(2).As<int*>() = 6; // will change to 7 shortly but that's fine as players are guaranteed not to be in the waiting stage
		*script_local(launcher->m_stack, 233).at(Features::playerme, 3).at(2).as<int*>() = 6;
		*scr_globals::launcher_global.Add(3).Add(1).As<int*>() = script_id;
		launcher->m_context.m_state = eThreadState::running;
	}
	else
	{
		// 1F) Cannot find launcher
		//g_notification_service->push_error("Script", "Cannot start script, am_launcher not running locally");
	}
	Log::Msg("logs8");
}

