std::vector<char*> convertStringVectorToCharPointerVector(const std::vector<std::string>& stringVector) {
	std::vector<char*> charPointerVector;
	charPointerVector.reserve(stringVector.size());

	for (const auto& str : stringVector) {
		charPointerVector.push_back(const_cast<char*>(str.c_str()));
	}

	return charPointerVector;
}

int m_features::wheelfortune()
{
	std::vector<char*> charPointerVector = convertStringVectorToCharPointerVector(CasinoWheelOutcomeString);

	if (Menu2::ListVector("Wheel", charPointerVector, CasinoWheelOutcomePosition)) {
		m_features::LuckyWheelOutcome();
	}
	return 0;
}
std::vector<const char*> convertStringVectorToArray(const std::vector<std::string>& stringVector) {
	std::vector<const char*> charPointerVector;
	charPointerVector.reserve(stringVector.size());

	for (const auto& str : stringVector) {
		charPointerVector.push_back(str.c_str());
	}

	return charPointerVector;
}
