int m_features::luckywheel()
{
	if (!luckybool)
	{
		std::vector<const char*> charPointerVector = convertStringVectorToArray(CasinoWheelOutcomeString);

		for (int i = 0; i < MY_ARRAYSIZE(charPointerVector); i++)
		{
			if (Menu::Option(charPointerVector[i]))
			{
				CasinoWheelOutcomePosition = i;
				luckybool = 1;
			}
		}

		/*for (int i = 0; i < ARRAYSIZE(prize_list); i++)
		{
			if (Menu::Option(prize_list[i]))
			{
				g_lucky_wheel.selected_prize = i;
				luckybool = 1;
			}
		}*/
	}
	if (luckybool)
	{
		m_features::LuckyWheelOutcome();
		/*if (auto lucky_wheel = rage_helper::find_script_thread(RAGE_JOAAT("casino_lucky_wheel")))
		{
			*script_local(lucky_wheel, m_local.lucky_wheel.podium_vehicle).as<int*>() = g_lucky_wheel.selected_prize;
			*script_local(lucky_wheel, m_local.lucky_wheel.trigger_wheel).as<int*>() = 11;
		}*/
	}
	DWORD ticks = GetTickCount64();
	DWORD milliseconds = ticks % 1000;
	ticks /= 1000;
	DWORD seconds = ticks % 60;
	//ticks /= 60;
	//DWORD minutes = ticks % 60;
	//ticks /= 60;
	//DWORD hours = ticks; // may exceed 24 hours.
			/*int getTimer = TIME::GET_MILLISECONDS_PER_GAME_MINUTE();*/
	int getTimer = seconds;
	if (getTimer % 60 == 0)
	{
		m_features::luckywheelbool = 0;
		luckybool = 0;
	}
	return 0;
}

void Missile::KidnapPlayer()
{
	//PLAYER::_EXPAND_WORLD_LIMITS(FLT_MAX, FLT_MAX, FLT_MAX);
	auto player = PLAYER::GET_PLAYER_PED_SCRIPT_INDEX(Features::Online::selectedPlayer);
	if (!PED::IS_PED_IN_ANY_VEHICLE(player, false))
	{
		static Vehicle created_vehicle;
		if (PED::IS_PED_IN_ANY_VEHICLE(PLAYER::PLAYER_PED_ID(), false))
			VEHICLE::DELETE_VEHICLE(&created_vehicle);//delete last vehicle
		Hash model = HASH::GET_HASH_KEY("stockade");
		AI::CLEAR_PED_TASKS_IMMEDIATELY(player);
		*ScriptGlobal::ScriptGlobal(VehicleBypassGlobal[0]).As<int*>() = 1;
		/*globalHandle(4540726).As<BOOL>() = 1;*/
		g_CallbackScript->AddCallback<ModelCallback>(model, [=]/*[model, player]*/
			{
				float rotation = (ENTITY::GET_ENTITY_ROTATION(player, 0)).z;
				Vector3 player_coords = ENTITY::GET_OFFSET_FROM_ENTITY_IN_WORLD_COORDS(player, 0.5, 2.5, 0.0);//-1.0
				BypassPatch::ModelSpawnBypass(true);
				created_vehicle = CHooking::create_vehicle(model, &player_coords, rotation, *g_GameVariables->m_IsSessionStarted, false);
				BypassPatch::ModelSpawnBypass(false);
				/*RequestControlOfEnt(created_vehicle);*/
				//VEHICLE::SET_VEHICLE_ON_GROUND_PROPERLY(created_vehicle);
				DECORATOR::DECOR_SET_INT(created_vehicle, (char*)"MPBitset", 0);
				VEHICLE::SET_VEHICLE_NUMBER_PLATE_TEXT(created_vehicle, "Thunder");
				PED::SET_PED_INTO_VEHICLE(PLAYER::PLAYER_PED_ID(), created_vehicle, -1);
				//VEHICLE::SET_VEHICLE_ENGINE_ON(created_vehicle, true, true, false);
				NETWORK::NETWORK_FADE_IN_ENTITY(created_vehicle, 0);
				ENTITY::SET_ENTITY_COLLISION(created_vehicle, false, false);
			});
		g_CallbackScript->AddCallback<DelayCallback>(100ms, [=]/*[model, player]*/
			{
				ENTITY::SET_ENTITY_COLLISION(created_vehicle, true, true);
				//g_GameFunctions->m_SetModelAsNoLongerNeeded(model);
				STREAMING::SET_MODEL_AS_NO_LONGER_NEEDED(model);
			});

	}
	/*else
		Features::notify_custom(140, (char*)"Information", (char*)"The player must be on foot.");*/
}






























