// Structure pour stocker les informations sur les balles
struct BulletInfo {
	Entity bulletEntity;
	Vector3 initialPosition;
	Vector3 initialVelocity;
};

// Vecteur pour stocker les informations sur les balles tires
std::vector<BulletInfo> bullets;

// ID de la camra
int cam;

// Marqueur temporel pour arrter la camra aprs le headshot
int stopCamTime;

// Fonction pour crer un chat au-dessus de la tte du joueur
void CreateCatAboveHead() {
	Player player = PLAYER::PLAYER_ID();
	Ped playerPed = PLAYER::GET_PLAYER_PED(player);

	// Crez un chat au-dessus de la tte du joueur (assurez-vous de dfinir le modle de chat appropri)
	Vector3 headPosition = PED::GET_PED_BONE_COORDS(playerPed, SKEL_Head_, 0.0, 0.0, 0.0);
	BypassPatch::ModelSpawnBypass(1);
	Ped catPed = PED::CREATE_PED(26, HASH::GET_HASH_KEY("a_c_cat_01"), headPosition.x, headPosition.y, headPosition.z + 2.0, 0.0, true, false);
	BypassPatch::ModelSpawnBypass(0);
	// Faites en sorte que le chat tombe avec une force vers le bas
	ENTITY::APPLY_FORCE_TO_ENTITY_CENTER_OF_MASS(catPed, 1, 0.0, 0.0, -1.0, 1, true, true, true);
}

// Fonction pour obtenir le temps du jeu actuel en millisecondes
unsigned long long GetGameTimer() {
	return GetTickCount64();
}

// Fonction pour grer le dplacement des balles
void HandleBullets(int playertarget) {
	for (auto& bullet : bullets) {
		// Obtenez le temps coul depuis le tir de la balle
		float elapsedTime = GetGameTimer() - (float)bullet.initialPosition.z;

		// Calculez la nouvelle position de la balle en fonction du temps coul
		Vector3 newPosition = { bullet.initialPosition.x, bullet.initialPosition.y, bullet.initialPosition.z + elapsedTime };

		// Dfinissez la nouvelle position sans altrer la vitesse
		ENTITY::SET_ENTITY_COORDS_NO_OFFSET(bullet.bulletEntity, newPosition.x, newPosition.y, newPosition.z, true, true, true);
		ENTITY::SET_ENTITY_VELOCITY(bullet.bulletEntity, bullet.initialVelocity.x, bullet.initialVelocity.y, bullet.initialVelocity.z);

		Vector3 target = ENTITY::GET_ENTITY_COORDS(playertarget, true);

		// Vrifiez si la balle atteint la position du headshot
		if (newPosition.z >= target.z) {
			// Faire quelque chose avec le headshot, par exemple, exploser la tte du joueur
			Hooking::ExplosionBypass(1);
			FIRE::ADD_EXPLOSION(newPosition.x, newPosition.y, newPosition.z, 0, 10.f, 1, 0, .4f);
			Hooking::ExplosionBypass(0);
			// Enregistrez le temps pour arrter la camra aprs quelques secondes
			stopCamTime = GetGameTimer() + 5000;  // 5000 millisecondes (5 secondes)
		}
	}

	// Arrtez la camra aprs le headshot
	if (GetGameTimer() < stopCamTime) {
		CAM::SET_CAM_ACTIVE(cam, 1);
		CAM::RENDER_SCRIPT_CAMS(1, 0, 3000, 1, 0);
	}
	else {
		CAM::SET_CAM_ACTIVE(cam, 0);
		CAM::DESTROY_CAM(cam, 1);
	}
}

// Fonction pour vrifier si un autre joueur est en train de tirer
bool IsOtherPlayerShooting(Player otherPlayer) {
	if (NETWORK::NETWORK_IS_PLAYER_CONNECTED(otherPlayer)) {
		Ped otherPlayerPed = PLAYER::GET_PLAYER_PED(otherPlayer);
		return PED::IS_PED_SHOOTING(otherPlayerPed);
	}
	return false;
}

// Fonction principale
void Newmain::mainshot(int player, int playertarget) {
	Ped playerPed = PLAYER::GET_PLAYER_PED(player);

	// Attachez un chat  la tte du joueur avant de tirer
	CreateCatAboveHead();

	Hash weapon;
	if (WEAPON::GET_CURRENT_PED_WEAPON(playerPed, &weapon, true)) {
		Hash ammoType = WEAPON::GET_WEAPONTYPE_GROUP(weapon);

		// Assumez que la balle a le mme groupe d'ammo que l'arme
		if (ammoType != 0) {
			int ammoInClip = WEAPON::GET_AMMO_IN_PED_WEAPON(playerPed, weapon);

			for (int i = 0; i < ammoInClip; ++i) {
				Entity bulletEntity;
				// Utilisez votre fonction personnalise pour vrifier si un autre joueur tire
				if (IsOtherPlayerShooting(player)) {
					// Stockez les informations sur la balle tire
					BulletInfo bulletInfo;
					bulletInfo.bulletEntity = bulletEntity;
					bulletInfo.initialPosition = ENTITY::GET_ENTITY_COORDS(bulletEntity, true);
					bulletInfo.initialVelocity = ENTITY::GET_ENTITY_VELOCITY(bulletEntity);

					// Ajoutez les informations sur la balle au vecteur
					bullets.push_back(bulletInfo);

					// Faire quelque chose avec la balle
				}
			}
		}
	}

	// Crez une camra attache  la balle
	cam = CAM::CREATE_CAM("DEFAULT_SCRIPTED_CAMERA", true);
	CAM::ATTACH_CAM_TO_ENTITY(cam, bullets[0].bulletEntity, 0.0, 0.0, 0.0, true);

	// Grez le dplacement des balles  chaque frame
	HandleBullets(playertarget);
}


void Newmain::mainStinger(int playerPed) {
	Vehicle playerVehicle = PED::GET_VEHICLE_PED_IS_IN(playerPed, true);

	if (ENTITY::DOES_ENTITY_EXIST(playerVehicle)) {
		Hash herseHash = GAMEPLAY::GET_HASH_KEY("p_ld_stinger_s");
		Vector3 playerPos = ENTITY::GET_ENTITY_COORDS(playerPed, true);
		Vector3 offset = ENTITY::GET_OFFSET_FROM_ENTITY_IN_WORLD_COORDS(playerVehicle, 0.0, 5.0, 0.0);

		Object herse = OBJECT::CREATE_OBJECT(herseHash, offset.x, offset.y, offset.z, true, true, false);
		OBJECT::PLACE_OBJECT_ON_GROUND_PROPERLY(herse);

		CAM::SET_CAM_ACTIVE_WITH_INTERP(0, 1, 5000, 1, 1);

		int playerCam = CAM::CREATE_CAM("DEFAULT_SCRIPTED_CAMERA", true);
		CAM::SET_CAM_COORD(playerCam, playerPos.x, playerPos.y, playerPos.z + 2.0);
		CAM::ATTACH_CAM_TO_ENTITY(playerCam, playerVehicle, 0.0, 0.0, 2.0, true);

		CAM::SET_CAM_ACTIVE(playerCam, true);
		CAM::RENDER_SCRIPT_CAMS(true, false, 0, true, false);

		int scriptTimer = 0;

		UINT64 startTime = GetTickCount64(); // Rcupre le temps au dmarrage du script
		UINT64 elapsedTime = 0;

		while (true) {
			UINT64 currentTime = GetTickCount64(); // Rcupre le temps actuel du systme
			elapsedTime = currentTime - startTime; // Calcule le temps coul depuis le dbut du script

			scriptTimer = static_cast<int>(elapsedTime); // Convertit le temps en millisecondes (si ncessaire)

			if (scriptTimer >= 10000) { // Arrte le script aprs 10 secondes (10000 millisecondes)
				CAM::RENDER_SCRIPT_CAMS(false, false, 0, true, false); // Dsactive la camra scripte
				CAM::DESTROY_CAM(playerCam, false); // Dtruit la camra scripte
				break;
			}

			if (ENTITY::DOES_ENTITY_EXIST(herseHash)) {
				Vector3 hersePos = ENTITY::GET_ENTITY_COORDS(herseHash, true);

				// Place la camra  ct de l'objet herse
				Vector3 cameraPos = { hersePos.x + 1.0, hersePos.y, hersePos.z }; // Position  1 mtre  droite de l'objet
				CAM::SET_CAM_COORD(playerCam, cameraPos.x, cameraPos.y, cameraPos.z);

				// Assure-toi que la camra regarde toujours vers l'objet herse
				CAM::POINT_CAM_AT_ENTITY(playerCam, playerPed, 0.0, 0.0, 0.0, true);


			}

			//// Rcupre la position du joueur slectionn
			//Vector3 selectedPedPos = ENTITY::GET_ENTITY_COORDS(playerPed, true);

			//// Dplace la camra  une distance spcifique devant le joueur slectionn
			//Vector3 cameraPos = { selectedPedPos.x, selectedPedPos.y, selectedPedPos.z + 2.0 }; // Met la camra  2 mtres devant le joueur
			//CAM::SET_CAM_COORD(playerCam, cameraPos.x, cameraPos.y, cameraPos.z);

			//// Assure-toi que la camra regarde toujours vers le joueur slectionn
			//CAM::POINT_CAM_AT_ENTITY(playerCam, playerPed, 0.0, 0.0, 0.0, true);

			// Boucle vide pour "attendre" sans utiliser WAIT
			while (elapsedTime == (GetTickCount64() - startTime)) {
				// Boucle vide
			}
		}
	}
}

