void VEHICLEPLAYER::FixVehicle(SPlayer& player) {
	if (isitme)
	{
		Log::Msg("FixVehicle");
		if (!player.m_isInVehicle) return;
		GetEntityControl()->RequestControl("[FV]", player.m_vehicle, [](Entity vehicle) {VEHICLE::SET_VEHICLE_FIXED(vehicle); });
		auto const vehicleModelHash = ENTITY::GET_ENTITY_MODEL(player.m_vehicle);
		GetEntityControl()->RequestModel(static_cast<int>(vehicleModelHash), [=](int model) {});
		GetEntityControl()->Update();
	}
	else
	{
		int playerID = static_cast<int>(player);
		Log::Msg("FixVehicle player");
		if (!player.m_isInVehicle) return;
		const auto replay_interface = *g_GameVariables->m_ReplayInterface;
		if (!replay_interface)
			return;
		player.m_vehicle = reinterpret_cast<uintptr_t>(replay_interface->m_vehicle_interface->get_vehicle(playerID));
		GetEntityControl()->RequestControl("[FV]", player.m_vehicle, [](Entity vehicle) {VEHICLE::SET_VEHICLE_FIXED(vehicle); });
		auto const vehicleModelHash = ENTITY::GET_ENTITY_MODEL(player.m_vehicle);
		GetEntityControl()->RequestModel(static_cast<int>(vehicleModelHash), [=](int model) {});
		GetEntityControl()->Update();
	}

}

