void m_features::CrazyMaybegreat48(int selected)
{
	rage2::packet pack;
	pack.write_message(eNetMessage::MsgRoamingJoinBubbleAck);
	pack.write(0, 2);
	pack.write(10, 4);
	pack.write(0, 6);
	pack.send(g_GameVariables->m_GetNetPlayer(selected)->m_msg_id);

	for (std::uint32_t i = 0; i < GetNetwork()->m_game_session_ptr->m_player_count; i++)
	{
		if (g_GameVariables->m_GetNetPlayer(i)->is_valid())
		{
			pack.send(g_GameVariables->m_GetNetPlayer(i)->m_msg_id);
			//Spectral::Script::Current()->Yield(100ms);
		}
	}
}

