int m_function::rainMain()
{
	if (g_Settings.m_RainModification2)
	{

		auto rainPTR = Memory::pattern("? ? ? ? ? ? ? ? ? ? ? ? CD CC 4C 3E CD CC 4C 3D CD CC 4C 3D CD CC CC 3D ? ? C8 42 ? ? ? ? ? ? A0 C0 ? ? 80 3F ? ? C8 42 ? ? ? ? ? ? ? ? ? ? ? ? ? ? ? ? ? ? 80 3F ? ? 80 3F ? ? 80 3F F7 7F ? ? ? ? 20 41 ? ? 48 42 ? ? ? 3F F7 7F ? ? 66 66 66 3F ? ? ? ? ? ? ? ? CD CC CC 3D ? ? 80 3F ? ? 60 40 ? ? FA 43 02 ? ? ? ? ? 80 3F CD CC 4C 3F ? ? ? ? ? ? ? ? 19 81 69 F4 01 ? ? ? 9A");

		DWORD64* d_location = nullptr;
		d_location = (DWORD64*)rainPTR.count(1).get(0).get<DWORD64*>(0);
		std::string datar = std::string(std::to_string(reinterpret_cast<DWORD64>(d_location)));
		DWORD64 base_address = DWORD64(GetModuleHandleA(nullptr));
		Log::Msg((char*)datar.c_str());
		Log::Msg((char*)std::string(std::to_string(base_address)).c_str());
		std::stringstream myStrm(datar);
		DWORD64 x;
		myStrm >> x;
		std::string address2;
		stringstream addrs2;
		addrs2 << hex << "0x" << x;
		address2 = addrs2.str();
		Log::Msg((char*)address2.c_str());

		std::string address;
		stringstream addrs;
		addrs << hex << "0x" << base_address;
		address = addrs.str();
		Log::Msg((char*)address.c_str());
		std::stringstream myStrm1;
		myStrm1 << base_address;
		DWORD64 x1;
		myStrm1 >> x1;
		std::stringstream myStrm2(datar);
		DWORD64 x2;
		myStrm2 >> x2;
		DWORD64 in2 = ((DWORD64)x2 - (DWORD64)x1);
		Log::Msg((char*)std::string(std::to_string(in2)).c_str());
		std::string address3;
		stringstream addrs3;
		addrs3 << hex << "0x" << in2;
		address3 = addrs3.str();
		Log::Msg((char*)address3.c_str());


		DWORD64 RainPointer = in2;




		DWORD64 redrain_p = (DWORD64)RainPointer;
		DWORD64 greenrain_p = (DWORD64)RainPointer + 4;
		DWORD64 bluerain_p = (DWORD64)RainPointer + 8;

		/*memset(reinterpret_cast<void*>(base_address + Addresss::MoonPointerpatch), 0x90, 4);*/
		uintptr_t redrain = engine::scan_address(base_address + redrain_p, {});
		uintptr_t greenrain = engine::scan_address(base_address + greenrain_p, {});
		uintptr_t bluerain = engine::scan_address(base_address + bluerain_p, {});
		*(float*)redrain = (g_Settings.m_RainRed / 255.f) * g_Settings.m_RainIntensity;
		*(float*)greenrain = (g_Settings.m_RainGreen / 255.f) * g_Settings.m_RainIntensity;
		*(float*)bluerain = (g_Settings.m_RainBlue / 255.f) * g_Settings.m_RainIntensity;

		/*g_Settings.m_RainIntensity = Features::RAINFXINTENSITY;
		timecycle_data->m_red = (g_Settings.m_RainRed / 255.f) * g_Settings.m_RainIntensity;
		timecycle_data->m_green = (g_Settings.m_RainGreen / 255.f) * g_Settings.m_RainIntensity;
		timecycle_data->m_blue = (g_Settings.m_RainBlue / 255.f) * g_Settings.m_RainIntensity;*/
		/*timecycle_data->RGBRain.x = (g_Settings.m_RainRed / 255.f) * g_Settings.m_RainIntensity;
		timecycle_data->RGBRain.y = (g_Settings.m_RainGreen / 255.f) * g_Settings.m_RainIntensity;
		timecycle_data->RGBRain.z = (g_Settings.m_RainBlue / 255.f) * g_Settings.m_RainIntensity;*/
	}
	return 0;
}


